ing (ex. empathie, prototypage) a influencé des choix concrets dans le projet (ex. quelles fonctionnalités ont été conçues suite à un test utilisateur ?).</p><p>❌ Absence ou confusion dans le découpage en sprints</p><p>→ Aucun découpage en sprints n’est mentionné (ex. Sprint 1 : analyse et maquettes, Sprint 2 : implémentation des fonctionnalités). Le déroulé du travail n’est pas structuré en itérations claires.</p><p>❌ Copié-collé sans personnalisation, sans exemples concrets</p><p>→ Certaines parties (définitions de Scrum, rituels, etc.) semblent génériques. Il manque des exemples concrets du projet file rouge pour illustrer chaque méthode ou rituel appliqué</p>','1e54ff58-e5f2-4f86-9524-5eefa9388fab',102,1,1600,'2025-05-16 11:48:07','2025-05-16 11:48:07'),(1598,'2025-05-19 08:03:09','État de réalisation de la tâche : En cours','08202fba-f47e-43b6-8ce3-d93513696a0b',28,0,2562,'2025-05-19 07:03:09','2025-05-19 07:03:09'),(1599,'2025-05-19 08:03:24','État de réalisation de la tâche : En cours','23b8da47-b1ab-4728-8fbb-db4a347ae816',28,0,2562,'2025-05-19 07:03:24','2025-05-19 07:03:24'),(1601,'2025-05-19 08:04:11','État de réalisation de la tâche : En cours','bfcdbc4f-8301-49ba-ad5e-d0cb0c548bf6',28,0,2562,'2025-05-19 07:04:11','2025-05-19 07:04:11'),(1602,'2025-05-19 08:04:23','État de réalisation de la tâche : En cours','a771002c-41eb-4069-9cda-ad0dbc8ae3b2',69,0,2274,'2025-05-19 07:04:23','2025-05-19 07:04:23'),(1603,'2025-05-19 08:04:50','État de réalisation de la tâche : En cours','dba60c39-702f-4f77-a30b-566bb0777e0d',69,0,2294,'2025-05-19 07:04:50','2025-05-19 07:04:50'),(1604,'2025-05-19 08:05:11','Date de fin : 2025-06-12 00:00 </br> État de réalisation de la tâche : En cours','43719fa2-7be2-47ce-a1c4-288e56d10148',69,0,2294,'2025-05-19 07:05:11','2025-05-19 07:05:11'),(1605,'2025-05-19 11:38:57','État de réalisation de la tâche : En cours','e9674e1d-c23e-42e0-ad33-3fe9c6ad6e95',19,0,1557,'2025-05-19 10:38:57','2025-05-19 10:38:57'),(1606,'2025-05-19 11:41:23