che : En validation','416c70fa-0635-43f5-b22f-d06d1f7d888f',83,0,1617,'2025-05-19 13:44:37','2025-05-19 13:44:37'),(1737,'2025-05-19 14:44:47','État de réalisation de la tâche : En validation','abcbbb5f-601f-4891-b733-811429bb7732',19,0,1614,'2025-05-19 13:44:47','2025-05-19 13:44:47'),(1738,'2025-05-19 14:45:47','État de réalisation de la tâche : En cours','c3c88bc9-bd25-41a4-b828-e8236a58cce8',83,0,1617,'2025-05-19 13:45:47','2025-05-19 13:45:47'),(1739,'2025-05-19 14:47:38','Remarques - formateur : <p data-start=\"49\" data-end=\"283\" class=\"\">❌ <strong data-start=\"51\" data-end=\"89\">Introduction absente ou incomplète</strong><br data-start=\"89\" data-end=\"92\">\r\n➤ Le texte explique le <strong data-start=\"115\" data-end=\"144\">sujet de manière générale</strong>, mais <strong data-start=\"151\" data-end=\"191\">ne présente pas le projet spécifique</strong>, ni le contexte réel dans lequel il est réalisé (ex. formation, plateforme Soli-LMS, etc.).</p><p data-start=\"285\" data-end=\"468\" class=\"\">❌ <strong data-start=\"287\" data-end=\"327\">Contexte non expliqué ou mal formulé</strong><br data-start=\"327\" data-end=\"330\">\r\n➤ Il n’est pas précisé <strong data-start=\"353\" data-end=\"378\">pour quel besoin réel</strong> ce travail a été mené, ni dans <strong data-start=\"410\" data-end=\"424\">quel cadre</strong> (établissement, module, utilisateur final).</p><p data-start=\"470\" data-end=\"651\" class=\"\">❌ <strong data-start=\"472\" data-end=\"511\">Objectif du projet flou ou manquant</strong><br data-start=\"511\" data-end=\"514\">\r\n➤ Le texte ne contient pas d’<strong data-start=\"543\" data-end=\"574\">objectif formulé clairement</strong>, tel que : <em data-start=\"586\" data-end=\"650\">\"Ce projet vise à développer une application permettant de...\"</em>.</p><p data-start=\"653\" data-end=\"817\" class=\"\">❌ <strong data-start=\"655\" data-end=\"706\">Démarche générale absente ou non compréhensible</strong><br data-start=\"706\" data-end=\"709\">\r\n➤ Aucune mention de <strong data-start=\"729\" data-end=\"751\">méthode de travail</strong> (Agile, UX Design, sprints...), ni de structure de développement.</p><p data-start=\"819\" data-end=\"992\" class=\"\">❌ <strong data-start=\"821\" data-end=\"871\">Absence d’illustration ou image non pertinente</strong><br data-start=\"871\" data-end=\"874\">\r\n❌ <strong data-start=\"876\" data-end=\"936\">Image sans titre, de mauvaise qualité ou mal positionnée</strong><br data-start=\"936\" data-end=\"939\">\r\n➤ Aucune image n’est mentionnée, insérée, ni décrite.</p><p>\r\n\r\n\r\n\r\n\r\n</p><p data-start=\"994\" data-end=\"1144\" class=\"\">❌ <strong data-start=\"996\" data-end=\"1049\">Absence de transition vers les chapitres suivants</strong><br data-start=\"1049\" data-end=\"1052\">\r\n➤ Le texte se termine de manière générale, sans annoncer la suite du rapport ou du document.</p>','e5fff830-5a0b-4007-967d-ba751a925044',102,1,1593,'2025-05-19 13:47:38','2025-05-19 13:47:38'),(1740,'2025-05-19 14:50:16','État de réalisation de la tâche : Valide','31d816a8-ede8-4f66-ae67-8c20c477a6f2',102,0,1595,'2025-05-19 13:50:16','2025-05-19 13:50:16'),(1741,'2025-05-19 14:51:35','État de réalisation de la tâche : Valide','bdfa6b90-66b8-4213-b53b-962d340cae96',102,0,1600,'2025-05-19 13:51:35','2025-05-19 13:51:35'),(1742,'2025-05-19 14:52:02','État de réalisation de la tâche : Valide','7eb846ae-f345-4d2a-9506-5e07fd554782',102,0,1601,'2025-05-19 13:52:02','2025-05-19 13:52:02'),(1743,'2025-05-19 14:54:46','État de réalisation de la tâche : Valide','3b073dcb-fd2b-4253-bb11-837d7d9acb4d',102,0,1603,'2025-05-19 13:54:46','2025-05-19 13:54:46'),(1744,'2025-05-19 14:56:07','État de réalisation de la tâche : En cours','92d9300b-6ca2-446f-8f2d-6e6604dc5462',6,0,2649,'2025-05-19 13:56:07','2025-05-19 13:56:07'),(1745,'2025-05-19 14:57:36','État de réalisation de la tâche : Valide','20c38747-d5a6-43fa-b538-1ef2b26a8f68',102,0,1604,'2025-05-19 13:57:36','2025-05-19 13:57:3