INSERT INTO `projets` VALUES (21,'Projet file rouge','<h3 data-line=\"7\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%9B%A0%EF%B8%8F-travail-%C3%A0-faire\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🛠️&nbsp;Travail à faire</h3><p data-line=\"9\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Développer un module ou une fonctionnalité complète à intégrer dans la plateforme&nbsp;<span style=\"font-weight: 600;\">Soli-LMS</span>, en respectant une approche professionnelle basée sur les pratiques vues en formation. Le projet doit être réalisé en&nbsp;<span style=\"font-weight: 600;\">méthode Agile (Scrum)</span>&nbsp;sur&nbsp;<span style=\"font-weight: 600;\">deux sprints</span>, avec une approche centrée utilisateur issue du&nbsp;<span style=\"font-weight: 600;\">Design Thinking</span>.</p><p data-line=\"11\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Le livrable doit inclure :</p><ul data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Une&nbsp;<span style=\"font-weight: 600;\">conception technique</span>&nbsp;(diagrammes, maquettes)</li><li data-line=\"13\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Une&nbsp;<span style=\"font-weight: 600;\">implémentation fonctionnelle</span>&nbsp;du module avec un code propre, réutilisable</li><li data-line=\"14\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Une&nbsp;<span style=\"font-weight: 600;\">documentation claire</span>&nbsp;et une&nbsp;<span style=\"font-weight: 600;\">présentation synthétique</span></li></ul><hr data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h3 data-line=\"18\" class=\"code-line\" dir=\"auto\" id=\"%E2%9A%99%EF%B8%8F-contraintes-techniques\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">⚙️&nbsp;Contraintes techniques</h3><p data-line=\"20\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Le projet doit obligatoirement respecter les contraintes suivantes :</p><ul data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">🔧&nbsp;<span style=\"font-weight: 600;\">Framework :</span>&nbsp;Laravel 10+</li><li data-line=\"23\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">🧱&nbsp;<span style=\"font-weight: 600;\">Architecture :</span>&nbsp;Utilisation du&nbsp;<span style=\"font-weight: 600;\">Design Pattern Service</span></li><li data-line=\"24\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">🗃️&nbsp;<span style=\"font-weight: 600;\">Base de données :</span>&nbsp;MySQL</li><li data-line=\"25\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">📦&nbsp;<span style=\"font-weight: 600;\">Modularité :</span>&nbsp;Intégration via des&nbsp;<span style=\"font-weight: 600;\">Modules Laravel</span>&nbsp;(structure modulaire recommandée)</li><li data-line=\"26\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">🔄&nbsp;<span style=\"font-weight: 600;\">Organisation en sprints :</span>&nbsp;au moins&nbsp;<span style=\"font-weight: 600;\">2 sprints</span>, avec suivi du backlog</li><li data-line=\"27\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">🎨&nbsp;<span style=\"font-weight: 600;\">Maquettes UI/UX</span>&nbsp;à fournir avant développement (outil libre au choix)</li><li data-line=\"28\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">🧪&nbsp;<span style=\"font-weight: 600;\">Code versionné sur GitHub</span>, avec commits réguliers et propres</li><li data-line=\"29\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">🧩&nbsp;<span style=\"font-weight: 600;\">Intégration dans Soli-LMS</span>&nbsp;de manière cohérente (navigation, permission, routes, interface…)</li></ul>','<h3 data-line=\"33\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%8F-crit%C3%A8res-de-travail-%C3%A9valuation\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><br></h3><table data-line=\"35\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; margin-top: 0px; border-spacing: 0px; display: block; width: 695.79px; overflow: auto; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><thead data-line=\"35\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\"><tr data-line=\"35\" class=\"code-line\" dir=\"auto\" style=\"background-color: rgb(255, 255, 255); border-top: 1px solid rgb(198, 203, 209); position: relative;\"><th style=\"text-align: left; border: 1px solid rgb(223, 226, 229); padding: 6px 13px;\">Critère</th><th style=\"text-align: left; border: 1px solid rgb(223, 226, 229); padding: 6px 13px;\">Pondération</th></tr></thead><tbody data-line=\"37\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\"><tr data-line=\"37\" class=\"code-line\" dir=\"auto\" style=\"border-top: 1px solid rgb(198, 203, 209); position: relative;\"><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">Respect des exigences fonctionnelles</td><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">20%</td></tr><tr data-line=\"38\" class=\"code-line\" dir=\"auto\" style=\"background-color: rgb(246, 248, 250); border-top: 1px solid rgb(198, 203, 209); position: relative;\"><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">Qualité du code (propreté, lisibilité, réutilisabilité)</td><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">20%</td></tr><tr data-line=\"39\" class=\"code-line\" dir=\"auto\" style=\"border-top: 1px solid rgb(198, 203, 209); position: relative;\"><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">Intégration correcte dans Soli-LMS (UI, permission, structure)</td><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">15%</td></tr><tr data-line=\"40\" class=\"code-line\" dir=\"auto\" style=\"background-color: rgb(246, 248, 250); border-top: 1px solid rgb(198, 203, 209); position: relative;\"><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">Application du pattern Service et respect de l\'architecture modulaire</td><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">15%</td></tr><tr data-line=\"41\" class=\"code-line\" dir=\"auto\" style=\"border-top: 1px solid rgb(198, 203, 209); position: relative;\"><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">Maquettes et diagrammes (conception)</td><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">10%</td></tr><tr data-line=\"42\" class=\"code-line\" dir=\"auto\" style=\"background-color: rgb(246, 248, 250); border-top: 1px solid rgb(198, 203, 209); position: relative;\"><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">Gestion du projet en sprints (Scrum)</td><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">10%</td></tr><tr data-line=\"43\" class=\"code-line\" dir=\"auto\" style=\"border-top: 1px solid rgb(198, 203, 209); position: relative;\"><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">Documentation (rapport + lisibilité)</td><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">5%</td></tr><tr data-line=\"44\" class=\"code-line\" dir=\"auto\" style=\"background-color: rgb(246, 248, 250); border-top: 1px solid rgb(198, 203, 209); position: relative;\"><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">Déploiement et démonstration finale</td><td style=\"padding: 6px 13px; border: 1px solid rgb(223, 226, 229);\">5%</td></tr></tbody></table>',NULL,200,1,1,'f21849f7-78a7-44a0-828f-0c782cfe24a7','2025-02-19 10:06:52','2025-05-14 09:27:38'),(23,'Déploiement de l\'application Blog','<ol><li>Ateliers&nbsp;<ol><li>Atelier Linux</li><li>Atelier Réseaux LAN</li><li>Atelier Déploiement</li></ol></li></ol><p><br></p>','<ol><li>Réalisation d\'un atelier&nbsp;</li><li>Participation dans tous les ateliers</li><li>Déploiement de l\'application Blog sur Linux</li></ol>',NULL,5,1,1,'ce746922-9383-4acb-99e9-cb573b451cfc','2025-02-19 10:56:21','2025-02-19 10:56:21'),(28,'Gestion d\'un blog','<ol><li>Multilingue</li><li>API</li><li>One Page&nbsp;</li><li>Classe Request</li><li>Unit Test</li><li>Sécurité</li></ol>','Une application exécutable sur un serveur Linux',NULL,5,1,1,'d292c616-a219-4407-82ed-23d9f1ac9cb5','2025-02-27 12:58:20','2025-02-27 14:48:53'),(29,'Gestion d\'un projet scrum','Gestion d\'un projet scrum','Gestion d\'un projet scrum',NULL,10,1,1,'4143f7a4-0b90-4e03-8c0c-95d6bd9dc5e8','2025-02-27 15:00:48','2025-02-27 15:00:48'),(30,'Gestion Blog avec Vue JS','Réalisation de gestion des articles avec Vue JS','<p>Réalisation d\'une interface CRUD de gestion des articles en trois étapes :</p><ul><li>Bonjour Vue JS</li><li>Affichage des articles dans un table</li><li>Utilisation d\'un modal pendant l\'insertion d\'un nouveau article</li></ul>',NULL,5,1,1,'0a64a7a2-895d-44ab-8906-83dd698518ed','2025-03-06 10:01:06','2025-03-06 10:01:06'),(32,'Projet Fil Rouge','<p style=\"border: 0px solid; --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-po