rojet suivante :</p><div style=\"color: rgb(0, 0, 0); font-family: Consolas, &quot;Courier New&quot;, monospace; font-size: 14px; line-height: 19px; white-space: pre;\"><div>/todo-list-php &nbsp;</div><div>│── /config &nbsp;</div><div>│ &nbsp; ├── database.php &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color: #008000;\"># Connexion à la base de données &nbsp;</span></div><div>│── /includes &nbsp;</div><div>│ &nbsp; ├── header.php &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color: #008000;\"># En-tête &nbsp;</span></div><div>│ &nbsp; ├── footer.php &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color: #008000;\"># Pied de page &nbsp;</span></div><div>│── /auth &nbsp;</div><div>│ &nbsp; ├── register.php &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color: #008000;\"># Page d\'inscription &nbsp;</span></div><div>│ &nbsp; ├── login.php &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"color: #008000;\"># Page de connexion &nbsp;</span></div><div>│ &nbsp; ├── logout.php &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color: #008000;\"># Déconnexion &nbsp;</span></div><div>│── /lists &nbsp;</div><div>│ &nbsp; ├── add.php &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;    <span style=\"color: #008000;\"># Création d\'une liste &nbsp;</span></div><div>│ &nbsp; ├── update.php &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color: #008000;\"># Modification d\'une liste &nbsp;</span></div><div>│ &nbsp; ├── delete.php &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color: #008000;\"># Suppression d\'une liste &nbsp;</span></div><div>│── /tasks &nbsp;</div><div>│ &nbsp; ├── add.php &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"color: #008000;\"># Ajout d\'une tâche &nbsp;</span></div><div>│ &nbsp; ├── update.php &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color: #008000;\"># Modification d\'une tâche &nbsp;</span></div><div>│ &nbsp; ├── delete.php &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color: #008000;\"># Suppression d\'une tâche &nbsp;</span></div><div>│── index.php &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"color: #008000;\"># Page d\'accueil affichant les listes de l\'utilisateur &nbsp;</span></div><div>│── styles.css &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color: #008000;\"># Fichier CSS pour le design &nbsp;</span></div></div>',NULL,10,3,2,'9f7420c5-bb0b-44d8-971c-20d026a46217','2025-03-12 12:57:18','2025-03-12 13:16:40'),(36,'Gestion des événements d’une association culturelle','<p><span id=\"docs-internal-guid-65a329f7-7fff-08bd-8681-4f75d95644eb\"></span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Une association culturelle souhaite moderniser ses opérations en automatisant la gestion de ses événements, comprenant la planification de spectacles variés, tels que le théâtre, le cinéma et la musique, ainsi que des rencontres et animations régulières. L\'association dispose de trois salles de capacités respectives de 600, 300 et 150 places. Elle propose différentes tarifications pour ses événements, notamment un tarif normal pour le public, un tarif réduit pour les étudiants et les enfants de moins de 12 ans.</span></p><h2 dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:18pt;margin-bottom:6pt;\"><span style=\"font-size: 16pt; font-family: Arial, sans-serif; background-color: transparent; font-weight: 700; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><font color=\"#000000\">Règles de gestion :</font></span></h2><ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: Arial, sans-serif; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Chaque salle est caractérisée par un numéro de salle, une capacité en nombre de places, et une description.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Une salle peut accueillir divers types d\'événements.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Chaque événement est défini par un identifiant unique, un titre, une description, une date et une heure.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Certains événements peuvent être récurrents (ils peuvent se produire plusieurs fois).</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Un événement se déroule dans une salle et appartient à une catégorie telle que théâtre, cinéma, musique, rencontre, etc.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Les tarifs varient en fonction du type d\'événement avec deux catégories de tarification; tarif normal et tarif réduit (étudiants ou enfants de moins de 12 ans).</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Un utilisateur peut effectuer plusieurs réservations. Chaque réservation peut concerner un ou plusieurs billets, avec des informations détaillées telles que le type de billet, le prix et la salle.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Un utilisateur est caractérisé par un identifiant unique, un nom, un prénom et une adresse email.</span></p></li></ul><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><br></p><h2 dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:18pt;margin-bottom:6pt;\"><span style=\"font-size: 16pt; font-family: Arial, sans-serif; background-color: transparent; font-weight: 700; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"><font color=\"#000000\">Interfaces:</font></span></h2><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Page d’accueil:</span></p><ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Lister le catalogue des versions des événements à venir trié par date (sous forme de cartes) en affichant pour chaque événement: le titre, l’image, la date, la catégorie et un bouton “J’achète” OU un bouton “Guichet fermé” dans le cas où les billets ne sont plus disponibles.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Ajouter une barre de recherche par titre</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Ajouter les 2 filtres suivants :</span></p></li><ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"2\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Lister les événements entre deux dates données&nbsp;</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"2\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Lister les événements par catégorie (musique, cinéma, théâtre…)</span></p></li></ul></ul><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><b style=\"font-weight:normal;\" id=\"docs-internal-guid-548928d3-7fff-b297-1b39-532a36293abb\"><br></b></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Page détails d’un événement:</span></p><ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Lorsque l’utilisateur clique sur le bouton “J’achète” ou “Guichet fermé”, il sera redirigé vers une page affichant les détails de l’événement: le titre, l’image (en grande taille), la description, la date.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Un formulaire permettant à l’utilisateur de préciser le nombre de billets à acheter (pour les deux types de tarif).</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Un utilisateur n’est autorisé à valider ce formulaire d’achat que lorsqu’il est connecté.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Si l’utilisateur est déjà connecté, le clic sur le bouton “Valider” du formulaire affiche un message de confirmation avec une possibilité de voir les billets et la facture.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">La validation d’un achat est réussie si le nombre de billets à acheter est toujours disponible.&nbsp;</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Le numéro de place à assigner à chaque billet dépend de la capacité de la salle où se déroule l’événement en question.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Les numéros de places sont affectés de manière séquentielle.</span></p></li></ul><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><b style=\"font-weight:normal;\"><br></b></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Page d’authentification et d’inscription:</span></p><ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Un nouvel utilisateur doit s’inscrire pour effectuer un achat.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Un utilisateur ayant déjà un compte doit se connecter avant d’effectuer un achat.</span></p></li></ul><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><b style=\"font-weight:normal;\"><br></b></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Profil utilisateur:</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Lorsque l’utilisateur est connecté, il peut :</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"></p><ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Consulter et modifier ses informations personnelles (nom, prénom, email…)</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12pt;font-family:Arial,sans-serif;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Consulter la liste des ses achats sous forme d’un tableau affichant: la référence de la facture, la date d’achat ainsi que le total payé, avec la possibilité de voir la facture et les billets à l’aide de deux boutons “Voir mes billets” et “Voir ma facture”.</span></p></li></ul>','<p>Réaliser le MCD, créer la base de données et réaliser le projet PHP.</p>',NULL,10,3,2,'83676732-3d79-4422-a499-3356a4e89732','2025-03-12 13:22:44','2025-03-12 13:22:44'),(37,'EFM - Backend','<p><a href=\"https://github.com/solicode-web-mobile/efm-backend-2025\" target=\"_blank\">https://github.com/solicode-web-mobile/efm-backend-2025</a><br></p>','<p><a href=\"https://github.com/solicode-web-mobile/efm-backend-2025\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">https://github.com/solicode-web-mobile/efm-backend-2025</a></p>',NULL,1,1,1,'761d3380-d8bb-44fb-a920-a094613e202b','2025-03-24 09:11:46','2025-03-25 10:00:36'),(38,'Lab - résolution des exceptions','<div style=\"color: rgb(0, 0, 0); font-family: Consolas, &quot;Courier New&quot;, monospace; font-size: 14px; line-height: 19px; white-space: pre;\"><div><span style=\"color: #800000;font-weight: bold;\">## 🎯 Objectif de l’activité</span></div><br><div><span style=\"color: #0451a5;\">&gt;</span> Devenir <span style=\"color: #000080;font-weight: bold;\">**autonome dans la lecture, la compréhension et la résolution**</span> d’une erreur réelle en Laravel ou AJAX, en suivant une stratégie claire, avec un travail en binôme.</div><br><div>---</div><br><div><span style=\"color: #800000;font-weight: bold;\">## 📌 </span><span style=\"color: #000080;font-weight: bold;\">**Consigne Générale**</span></div><br><div>Chaque apprenant travaille sur <span style=\"color: #000080;font-weight: bold;\">**1 seule erreur/exception fréquente**</span> choisie dans la <span style=\"color: #000080;font-weight: bold;\">**liste des 20 erreurs Laravel/AJAX**</span>. L’activité se fait <span style=\"color: #000080;font-weight: bold;\">**en 5 étapes**</span>, avec présentation finale.</div><br></div>','<div style=\"color: rgb(0, 0, 0); font-family: Consolas, &quot;Courier New&quot;, monospace; font-size: 14px; line-height: 19px; white-space: pre;\"><div><span style=\"color: #800000;font-weight: bold;\">## 📝 Détail du Travail à Réaliser</span></div><br><div><span style=\"color: #800000;font-weight: bold;\">### 🔹 Étape 1 – Reproduction de l’erreur (Individuel)</span></div><br><div><span style=\"color: #0451a5;\">1.</span> Reçois une erreur (ex : <span style=\"color: #800000;\">`419 Page Expired`</span>, <span style=\"color: #800000;\">`Undefined variable`</span>…).</div><div><span style=\"color: #0451a5;\">2.</span> Crée une <span style=\"color: #000080;font-weight: bold;\">**branche Git dédiée**</span> à cette erreur.</div><div><span style=\"color: #0451a5;\">3.</span> Dans un projet Laravel, <span style=\"color: #000080;font-weight: bold;\">**provoque volontairement cette erreur**</span> avec un exemple simple.</div><div><span style=\"color: #0451a5;\">4.</span> Fais un <span style=\"color: #000080;font-weight: bold;\">**commit clair**</span> (ex : <span style=\"color: #800000;\">`scénario: erreur csrf 419`</span>).</div><br><div>🎯 <span style=\"font-style: italic;\">*Tu deviens le \"créateur de l’erreur\", comme un testeur.*</span></div><br><div>---</div><br><div><span style=\"color: #800000;font-weight: bold;\">### 🔹 Étape 2 – Échange de branches (Binôme)</span></div><br><div><span style=\"color: #0451a5;\">-</span> Tu échanges ta branche avec celle d’un binôme.</div><div><span style=\"color: #0451a5;\">-</span> Tu vas maintenant <span style=\"color: #000080;font-weight: bold;\">**résoudre**</span> une erreur <span style=\"color: #000080;font-weight: bold;\">**que tu n’as pas créée.**</span></div><br><div>---</div><br><div><span style=\"color: #800000;font-weight: bold;\">### 🔹 Étape 3 – Résolution avec la Stratégie Affichée</span></div><br><div>Suis les <span style=\"color: #000080;font-weight: bold;\">**5 étapes de la stratégie**</span> (affichée au tableau) :</div><br><div><span style=\"color: #0451a5;\">1.</span> Lire l’erreur</div><div><span style=\"color: #0451a5;\">2.</span> Identifier le type d’erreur (syntaxe, logique, sécurité, etc.)</div><div><span style=\"color: #0451a5;\">3.</span> Chercher la cause (via documentation, Google, blog de Solicode…)</div><div><span style=\"color: #0451a5;\">4.</span> Appliquer une solution testable</div><div><span style=\"color: #0451a5;\">5.</span> Vérifier et valider</div><br><div>🧠 <span style=\"color: #000080;font-weight: bold;\">**Le but n’est pas seulement de corriger, mais de comprendre !**</span></div><br><div>---</div><br><div><span style=\"color: #800000;font-weight: bold;\">### 🔹 Étape 4 – Présentation rapide (en 3 min)</span></div><br><div>Tu expliques en binôme :</div><div><span style=\"color: #0451a5;\">-</span> Quel était le message d’erreur</div><div><span style=\"color: #0451a5;\">-</span> D’où il venait</div><div><span style=\"color: #0451a5;\">-</span> Comment tu l’as résolu</div><div><span style=\"color: #0451a5;\">-</span> Quelle étape de la stratégie t’a aidé le plus</div><br><div><span style=\"color: #0451a5;\">&gt;</span> Tu peux aussi faire une <span style=\"color: #000080;font-weight: bold;\">**fiche technique**</span> si tu préfères à l’oral.</div><br><div>---</div><br><div><span style=\"color: #800000;font-weight: bold;\">### 🔹 Étape 5 – Capitalisation collective</span></div><br><div><span style=\"color: #0451a5;\">-</span> Chaque erreur résolue est documentée dans un dossier partagé (<span style=\"color: #800000;\">`/docs/erreurs/`</span>) :</div><div>&nbsp; <span style=\"color: #0451a5;\">-</span> ✅ Nom de l’erreur</div><div>&nbsp; <span style=\"color: #0451a5;\">-</span> 📜 Scénario pour la générer</div><div>&nbsp; <span style=\"color: #0451a5;\">-</span> 🛠️ Solution utilisée</div><div>&nbsp; <span style=\"color: #0451a5;\">-</span> 🧠 Le binôme qui l’a résolue</div><br><div>---</div></div>',NULL,1,1,1,'0f9290d9-94b7-44a8-aa20-f2b8426c4e14','2025-03-26 09:15:06','2025-03-26 09:20:47'),(39,'SoliTODO','<p>Création d\'une application mobile TODO Liste</p>','<p>Mobile</p>',NULL,5,1,1,'79ccb512-2cd5-439f-bd30-b76748831cfe','2025-03-27 14:39:45','2025-03-27 14:39:45'),(40,'Gestion de projet','<p>Gestion de projet</p>','<p>Gestion de projet</p>',NULL,100,1,1,'94313acf-3c24-4d6b-9236-b1114ea0b6d6','2025-04-02 10:49:18','2025-04-02 10:49:18'),(42,'Site vitrine en WordPress','<p>On vous demande de réaliser un site vitrine qui présente une entreprise, un service, une marque personnelle ou tout autre concept choisi par vous meme.<span style=\"font-size: 1rem;\">Ce site doit être à la fois esthétiquement attractif, ergonomique et fonctionnel, tout en illustrant les bases du développement sous WordPress.</span></p>','<p>Votre site doit contenir au moins trois pages:home,contact,about\r\n</p><ul><li><b>\r\nhome</b>:Cette page doit contenir une banière d\'introduction avec exposition de vos services ou produits (sous forme de médias et descriptions courtes)</li><li><b>\r\ncontact</b>:C\'est une interface de mise en contact avec l\'admin,contient un formulaire de contact et une localisation\r\n</li><li><b>\r\nabout</b>:Présentation de l\'entité/service/marque avec des témoignages</li></ul><p>Utiliser des plugins pour:</p><ul><li>Traduire votre site vers une autre langue (Anglais ou Francais)</li><li>Optimiser le SEO</li><li>Elaborer le formulaire de contact</li><li><strong data-start=\"1063\" data-end=\"1081\">WP Super Cache</strong> ou <strong data-start=\"1085\" data-end=\"1103\">W3 Total Cache </strong><span data-start=\"1085\" data-end=\"1103\">pour améliorer la vitesse de chargement de votre site</span></li><li><strong data-start=\"1085\" data-end=\"1103\">Wordfence Security </strong><span data-start=\"1085\" data-end=\"1103\">pour sécuriser votre site</span></li><li><span data-start=\"1085\" data-end=\"1103\"><strong data-start=\"1430\" data-end=\"1445\" style=\"font-weight: bold;\">UpdraftPlus </strong><span data-start=\"1430\" data-end=\"1445\" style=\"\">pour simplifier la création et la restauration des sauvegardes</span></span></li></ul>',NULL,3,2,2,'2b663515-a8da-4fbe-9e25-544aa4947104','2025-04-08 09:47:33','2025-04-08 10:03:46'),(43,'CRUD (PHP/MYSQL)','<p>Système de gestion d\'authentification sécurisé&nbsp;</p>','<p>Système de gestion d\'authentification sécurisé&nbsp;</p>',NULL,10,4,2,'02358aef-040c-4194-bc79-a965c885cd2f','2025-04-09 11:30:33','2025-04-11 07:33:13'),(44,'Application web pour une meilleure gestion budgétaire','<p data-start=\"308\" data-end=\"388\" class=\"\">Développer une application PHP permettant à un utilisateur de :</p><p>\r\n</p><ul data-start=\"389\" data-end=\"505\">\r\n<li data-start=\"389\" data-end=\"420\" class=\"\">\r\n<p data-start=\"391\" data-end=\"420\" class=\"\">Gérer ses revenus et dépenses</p>\r\n</li>\r\n<li data-start=\"421\" data-end=\"454\" class=\"\">\r\n<p data-start=\"423\" data-end=\"454\" class=\"\">Suivre l’évolution de son solde</p>\r\n</li>\r\n<li data-start=\"455\" data-end=\"505\" class=\"\">\r\n<p data-start=\"457\" data-end=\"505\" class=\"\">Visualiser un historique et un résumé budgétaire</p></li></ul>','<p>Fonctionnalités attendues:</p><ul><li>Page d\'authentification</li><li>Page d\'inscription</li><li>Gestion des transactions:<ul><li>Ajouter une transaction :Une transaction est définie par :type (dépense ou revenu),montant,catégorie,description,date transaction</li><li>Supprimer une transaction</li><li>modifier une transaction</li><li>afficher l\'historique des transactions triés par date,ajouter un filtre sur les années et les mois</li></ul></li><li>Tableau de bord:<ul><li>Afficher le solde actuel</li><li>Résumé du mois en cours : total des revenus / dépenses</li><li>Somme totale des dépenses/revenus par catégorie</li><li>Afficher la dépense la plus haute ainsi que le revenu le plus grand du mois en cours</li></ul></li></ul><p><b>NB:</b></p><ul><li>Pour assurer une meilleure sécurité de vos données veillez à hasher les mots de passe</li><li>Utiliser un fichier config.php pour la configuration de connection avec la base de données</li><li>Tous les formulaires devraient etre validés avec un affichage personnalisé de messages d\'erreurs</li><li>Veiller à nettoyer les données avant de les insérer dans la base de données</li><li>Utiliser des fonctions pour mieux structurer votre code,les classer dans des fichiers \'user,transactions,dashboard\':<ul><li>addUser($user,$connection)</li><li>log($email,$password,$connection)</li><li>addTransaction($transaction,$connection)</li><li>deleteTransaction($idTransaction,$connection)</li><li>editTransaction($idTransaction,$newTransaction,$connection)</li><li>listTransactions($connection)</li><li>listTransactionsbyMonth($connection,$year,$month)</li><li>soldUser($connection)</li><li>detailsUser($connection)</li><li>totalIncomesByCategory($category,$connection)</li><li>totalExpensesByCategory($category,$connection)</li></ul></li></ul>',NULL,8,2,2,'74ff3b41-4be0-4416-baa5-1166202dafcb','2025-04-11 09:28:58','2025-04-11 10:16:20'),(45,'Landing page avec WP','<p>Création d\'une Landing page en utilisant WP</p>','<p>Création d\'une Landing page en utilisant WP</p>',NULL,5,5,2,'f94891ff-d437-440c-9d01-357eb2e373d2','2025-04-14 10:22:27','2025-04-14 10:22:27'),(46,'Veille Active et Présentation Technologique','<p data-start=\"591\" data-end=\"728\" class=\"\">Les apprenants devront, par <strong data-start=\"619\" data-end=\"648\">équipe de 3 à 5 personnes</strong>, organiser une veille et des ateliers de présentation sur les thèmes suivants :</p><ol data-start=\"730\" data-end=\"923\">\r\n<li data-start=\"730\" data-end=\"752\" class=\"\">\r\n<p data-start=\"733\" data-end=\"752\" class=\"\"><strong data-start=\"733\" data-end=\"752\">Atelier Laravel</strong></p>\r\n</li>\r\n<li data-start=\"753\" data-end=\"789\" class=\"\">\r\n<p data-start=\"756\" data-end=\"789\" class=\"\"><strong data-start=\"756\" data-end=\"789\">Atelier Matériel Informatique</strong></p>\r\n</li>\r\n<li data-start=\"790\" data-end=\"812\" class=\"\">\r\n<p data-start=\"793\" data-end=\"812\" class=\"\"><strong data-start=\"793\" data-end=\"812\">Atelier Réseaux</strong></p>\r\n</li>\r\n<li data-start=\"813\" data-end=\"868\" class=\"\">\r\n<p data-start=\"816\" data-end=\"868\" class=\"\"><strong data-start=\"816\" data-end=\"868\">Veille sur les technologies à étudier (au choix)</strong></p>\r\n</li>\r\n<li data-start=\"869\" data-end=\"923\" class=\"\">\r\n<p data-start=\"872\" data-end=\"923\" class=\"\"><strong data-start=\"872\" data-end=\"923\">Présentation finale de la veille (format libre)</strong></p>\r\n</li>\r\n</ol><p data-start=\"925\" data-end=\"991\" class=\"\">Pour chaque <strong data-start=\"937\" data-end=\"958\">atelier ou veille</strong>, le travail suivant est requis :</p><p>\r\n\r\n\r\n</p><ul data-start=\"993\" data-end=\"1274\">\r\n<li data-start=\"993\" data-end=\"1055\" class=\"\">\r\n<p data-start=\"995\" data-end=\"1055\" class=\"\">1 slide explicatif du sujet (Google Slides ou PowerPoint)</p>\r\n</li>\r\n<li data-start=\"1056\" data-end=\"1107\" class=\"\">\r\n<p data-start=\"1058\" data-end=\"1107\" class=\"\">flyer de vulgarisation (format image ou PDF)</p>\r\n</li>\r\n<li data-start=\"1108\" data-end=\"1274\" class=\"\">\r\n<p data-start=\"1110\" data-end=\"1134\" class=\"\">1 dépôt GitHub avec :</p>\r\n<ul data-start=\"1137\" data-end=\"1274\">\r\n<li data-start=\"1137\" data-end=\"1165\" class=\"\">\r\n<p data-start=\"1139\" data-end=\"1165\" class=\"\">Le support de présentation</p>\r\n</li>\r\n<li data-start=\"1168\" data-end=\"1226\" class=\"\">\r\n<p data-start=\"1170\" data-end=\"1226\" class=\"\">Les éventuelles ressources (code source, tutoriels, PDF)</p>\r\n</li>\r\n<li data-start=\"1229\" data-end=\"1274\" class=\"\">\r\n<p data-start=\"1231\" data-end=\"1274\" class=\"\">Un README clair avec la démarche de travail</p></li></ul></li></ul>','<table class=\"min-w-full\" data-start=\"1334\" data-end=\"1801\"><thead data-start=\"1334\" data-end=\"1362\"><tr data-start=\"1334\" data-end=\"1362\"><th data-start=\"1334\" data-end=\"1344\">Critère</th><th data-start=\"1344\" data-end=\"1362\">Détail attendu</th></tr></thead><tbody data-start=\"1391\" data-end=\"1801\"><tr data-start=\"1391\" data-end=\"1449\"><td class=\"max-w-[calc(var(--thread-content-max-width)*2/3)]\" data-start=\"1391\" data-end=\"1411\">Clarté du support</td><td class=\"max-w-[calc(var(--thread-content-max-width)*2/3)]\" data-start=\"1411\" data-end=\"1449\">Slide structuré, cohérent, lisible</td></tr><tr data-start=\"1450\" data-end=\"1519\"><td class=\"max-w-[calc(var(--thread-content-max-width)*2/3)]\" data-start=\"1450\" data-end=\"1473\">Pertinence technique</td><td class=\"max-w-[calc(var(--thread-content-max-width)*2/3)] min-w-[calc(var(--thread-content-max-width)/3)]\" data-start=\"1473\" data-end=\"1519\">Le contenu est vérifié, juste et documenté</td></tr><tr data-start=\"1520\" data-end=\"1580\"><td class=\"max-w-[calc(var(--thread-content-max-width)*2/3)]\" data-start=\"1520\" data-end=\"1545\">Communication visuelle</td><td class=\"max-w-[calc(var(--thread-content-max-width)*2/3)]\" data-start=\"1545\" data-end=\"1580\">Flyer attractif, compréhensible</td></tr><tr data-start=\"1581\" data-end=\"1655\"><td class=\"max-w-[calc(var(--thread-content-max-width)*2/3)]\" data-start=\"1581\" data-end=\"1604\">Qualité du dépôt Git</td><td class=\"max-w-[calc(var(--thread-content-max-width)*2/3)] min-w-[calc(var(--thread-content-max-width)/3)]\" data-start=\"1604\" data-end=\"1655\">Bien structuré, README complet, fichiers rangés</td></tr><tr data-start=\"1656\" data-end=\"1724\"><td class=\"max-w-[calc(var(--thread-content-max-width)*2/3)]\" data-start=\"1656\" data-end=\"1672\">Collaboration</td><td class=\"max-w-[calc(var(--thread-content-max-width)*2/3)] min-w-[calc(var(--thread-content-max-width)/3)]\" data-start=\"1672\" data-end=\"1724\">Répartition visible des tâches entre les membres</td></tr><tr data-start=\"1725\" data-end=\"1801\"><td class=\"max-w-[calc(var(--thread-content-max-width)*2/3)]\" data-start=\"1725\" data-end=\"1746\">Présentation orale</td><td class=\"max-w-[calc(var(--thread-content-max-width)*2/3)] min-w-[calc(var(--thread-content-max-width)/3)]\" data-start=\"1746\" data-end=\"1801\">Temps respecté, clarté, interactions avec le public</td></tr></tbody></table>',NULL,5,1,1,'c6325def-113b-4dbe-93f0-2f486646919e','2025-04-15 07:22:21','2025-04-15 07:23:03'),(47,'EFM Mobile','<p dir=\"auto\" style=\"margin-bottom: 16px; color: rgb(31, 35, 40); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Noto Sans&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Tu es chargé(e) de développer une application mobile Android de type&nbsp;<span style=\"font-weight: 600;\">TODO List</span>.<br>L’objectif de cet examen est d’évaluer ta capacité à :</p><ul dir=\"auto\" style=\"padding-left: 2em; margin-bottom: 16px; color: rgb(31, 35, 40); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Noto Sans&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li>✅&nbsp;<span style=\"font-weight: 600;\">Adapter</span>&nbsp;un prototype existant (niveau suivi)</li><li style=\"margin-top: 0.25em;\">✅&nbsp;<span style=\"font-weight: 600;\">Imiter</span>&nbsp;une logique métier existante (niveau reproduction)</li><li style=\"margin-top: 0.25em;\">✅&nbsp;<span style=\"font-weight: 600;\">Transposer</span>&nbsp;cette logique à de nouveaux comportements (niveau autonomie)</li></ul>','<div class=\"markdown-heading\" dir=\"auto\" style=\"position: relative; color: rgb(31, 35, 40); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Noto Sans&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h2 tabindex=\"-1\" class=\"heading-element\" dir=\"auto\" style=\"margin-top: 24px; margin-bottom: 16px; font-size: 1.5em; font-weight: 600; line-height: 1.25; padding-bottom: 0.3em; border-bottom: 0.606061px solid rgba(209, 217, 224, 0.7);\">❗️&nbsp;Condition d’accès aux Dossiers 2 et 3</h2><a id=\"user-content-️-condition-daccès-aux-dossiers-2-et-3\" class=\"anchor\" aria-label=\"Permalink: ❗️ Condition d’accès aux Dossiers 2 et 3\" href=\"https://github.com/solicode-web-mobile/efm-mobile-2025/blob/master/V1.TODO.md#%EF%B8%8F-condition-dacc%C3%A8s-aux-dossiers-2-et-3\" style=\"color: rgb(9, 105, 218); text-decoration-line: underline; float: left; padding-right: 4px; margin: auto; line-height: 1; position: absolute; top: 18.892px; left: -28px; display: flex; width: 28px; height: 28px; border-radius: 6px; opacity: 0; justify-content: center; align-items: center; transform: translateY(calc(-50% - 0.3rem)); text-underline-offset: 0.2rem;\"><svg class=\"octicon octicon-link\" viewBox=\"0 0 16 16\" version=\"1.1\" width=\"16\" height=\"16\" aria-hidden=\"true\"><path d=\"m7.775 3.275 1.25-1.25a3.5 3.5 0 1 1 4.95 4.95l-2.5 2.5a3.5 3.5 0 0 1-4.95 0 .751.751 0 0 1 .018-1.042.751.751 0 0 1 1.042-.018 1.998 1.998 0 0 0 2.83 0l2.5-2.5a2.002 2.002 0 0 0-2.83-2.83l-1.25 1.25a.751.751 0 0 1-1.042-.018.751.751 0 0 1-.018-1.042Zm-4.69 9.64a1.998 1.998 0 0 0 2.83 0l1.25-1.25a.751.751 0 0 1 1.042.018.751.751 0 0 1 .018 1.042l-1.25 1.25a3.5 3.5 0 1 1-4.95-4.95l2.5-2.5a3.5 3.5 0 0 1 4.95 0 .751.751 0 0 1-.018 1.042.751.751 0 0 1-1.042.018 1.998 1.998 0 0 0-2.83 0l-2.5 2.5a1.998 1.998 0 0 0 0 2.83Z\"></path></svg></a></div><p dir=\"auto\" style=\"margin-bottom: 16px; color: rgb(31, 35, 40); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Noto Sans&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🔒 Le&nbsp;<span style=\"font-weight: 600;\">Dossier 1 est obligatoire et éliminatoire</span>&nbsp;:</p><ul dir=\"auto\" style=\"padding-left: 2em; margin-bottom: 16px; color: rgb(31, 35, 40); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Noto Sans&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li>Si l’application modifiée fonctionne, tu passes aux Dossiers 2 et 3.<br>→&nbsp;<span style=\"font-weight: 600;\">Note finale sur 40 points</span></li><li style=\"margin-top: 0.25em;\">Si l’exécution échoue, tu seras réorienté vers un&nbsp;<span style=\"font-weight: 600;\">nouveau sujet</span>&nbsp;lors de la V2 (Jour 2).<br>→ Ta note sera recalculée selon un autre barème.</li></ul><p dir=\"auto\" style=\"margin-bottom: 16px; color: rgb(31, 35, 40); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Noto Sans&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📌 Les trois dossiers sont réalisés&nbsp;<span style=\"font-weight: 600;\">en live coding</span>, en présence du formateur évaluateur.</p>',NULL,1,1,1,'042e792f-6ff2-4479-9fff-624b286e6e5a','2025-04-17 07:05:52','2025-04-22 07:52:40'),(48,'Projet : Site web VILLE DE MAROC','<p>Développement d\'un site web sur les villes du Maroc en utilisant WordPress</p>','<p>WordPress</p>',NULL,5,5,2,'1a07ba07-845c-4113-8a9a-580cb97fff1e','2025-04-17 07:21:33','2025-04-17 07:21:33'),(49,'Projet fil rouge','<h6 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; line-height: 2.4rem;\" class=\"\"><font color=\"#000000\" face=\"Nunito Sans, sans-serif\"><span style=\"font-size: 16px; white-space-collapse: preserve;\">Dans le cadre de votre Projet Fil Rouge, vous allez concevoir et développer une application web qui met en pratique l’ensemble des compétences acquises tout au long de l’année. Ce projet est un exercice de synthèse qui vous permettra de démontrer votre maîtrise des différents aspects du développement web, de l’analyse des besoins jusqu’à la présentation finale de votre travail.</span></font></h6><div><br></div><h6 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; line-height: 2.4rem;\" class=\"\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-family: &quot;Nunito Sans&quot;, sans-serif; font-size: 1.4rem; white-space-collapse: preserve;\"></span></span></h6><div><br></div>','<p>1. Planification des tâches à effectuer</p><p><span style=\"font-size: 1rem;\">Avant de commencer le développement, il est essentiel d’organiser le travail :</span></p><ul><li>Définir les étapes du projet et les répartir dans le temps.</li><li>Estimer la charge de travail pour chaque tâche.</li><li>Établir un planning prévisionnel sous forme de tableau, Kanban (Trello, GitHub Projects) ou diagramme de Gantt.</li></ul><p>2. Rédaction du cahier des charges</p><p><span style=\"font-size: 1rem;\">Le cahier des charges est un document qui formalise les attentes du projet. Il doit contenir :</span></p><ul><li>Présentation générale : objectifs et enjeux du projet.</li><li>Public cible : qui utilisera l’application et dans quel contexte ?</li><li>Description des fonctionnalités : liste des principales fonctionnalités attendues.</li><li>Contraintes techniques : technologies utilisées (PHP, MySQL, HTML, CSS, JavaScript, etc.), compatibilité, sécurité.</li><li>Contraintes ergonomiques et graphiques : règles d’UX/UI, identité visuelle.</li></ul><p>3. Maquettage des différentes pages de votre application</p><p><span style=\"font-size: 1rem;\">Produire des maquettes avec l\'outil Figma :</span></p><ul><li><span style=\"font-size: 1rem;\">Réaliser les maquettes Desktop et Mobile pour représenter la disposition des éléments des pages de votre application.</span></li></ul><p><b>Remarque :</b> valider les maquettes avec votre formateur référent avant de passer au développement.</p><p>4. Conception logicielle&nbsp;</p><ul><li><span style=\"font-size: 1rem;\">Diagramme de cas d\'utilisation: représenter les interactions entre les utilisateurs et le système.</span></li></ul><p>5. Conception de base de données</p><ul><li>Elaborer le dictionnaire de données</li><li>Réaliser un MCD (Modèle Conceptuel de Données) et un MPD (Modèle Physique de Données).</li><li>Rédiger les scripts SQL pour la création du schéma de la base de données.</li></ul><p><b>Remarque :</b> valider la base de données avec votre formateur référent avant de passer au développement.</p><p>6. Codage et réalisation</p><ul><li>Développer l’application en respectant les bonnes pratiques (structuration du code, validation des entrées utilisateur, sécurité).</li><li>Implémenter les fonctionnalités définies dans le cahier des charges.</li><li>Tester régulièrement l’application et corriger les erreurs.</li><li>Utiliser GitHub pour la gestion du code et le suivi des versions.</li></ul><p>7. Rédaction du rapport&nbsp;</p><p><span style=\"font-size: 1rem;\">Le rapport doit présenter et expliquer votre démarche de manière claire et structurée :</span></p><ul><li><b>Introduction : </b>présentation du projet, objectifs, contexte.</li><li><b>Analyse :</b> besoin du client, problématique, cahier des charges.</li><li><b>Conception : </b>maquettes, base de données, UML.</li><li><b>Développement : </b>technologies utilisées, architecture du code.</li><li><b>Tests et validation :</b> description des tests effectués.</li><li><b>Conclusion et perspectives : </b>bilan du projet et axes d’amélioration.</li></ul><p>8. Préparation de la présentation pour la soutenance</p><ul><li>Concevoir un diaporama clair et synthétique.</li><li>Structurer la présentation en introduction, développement et conclusion.</li><li>Expliquer les choix techniques et les difficultés rencontrées.</li><li>S’entraîner à présenter et à répondre aux questions.</li></ul>',NULL,28,2,2,'daffb96e-159d-42d0-96e3-a37af4d02270','2025-04-23 09:53:20','2025-04-23 09:53:56'),(50,'Page de contact','<p>Créer une page de contact avec WP et récupération des données</p>','<p>Créer une page de contact avec WP et récupération des données</p>',NULL,3,5,2,'4c6f7869-8ffe-4731-948a-108794c2bc1b','2025-05-12 07:25:22','2025-05-12 07:25:22'),(51,'Crée le site vitrine d’un artisan local','<p>Tu es chargé(e) de créer le <strong data-start=\"1937\" data-end=\"1966\">site vitrine d’un artisan</strong> (boulanger, menuisier, fleuriste, coiffeur, etc.) souhaitant présenter son activité en ligne pour toucher de nouveaux clients.</p>','<h4 data-start=\"2190\" data-end=\"2215\" class=\"\">Livrables attendus :</h4><p data-start=\"2216\" data-end=\"2289\" class=\"\">Un site WordPress fonctionnel avec au minimum <strong data-start=\"2262\" data-end=\"2287\">les 5 pages suivantes</strong> :</p><ol data-start=\"2290\" data-end=\"2601\">\r\n<li data-start=\"2290\" data-end=\"2359\" class=\"\">\r\n<p data-start=\"2293\" data-end=\"2359\" class=\"\"><strong data-start=\"2293\" data-end=\"2304\">Accueil</strong> – Présentation rapide de l’activité, visuel accrocheur</p>\r\n</li>\r\n<li data-start=\"2360\" data-end=\"2409\" class=\"\">\r\n<p data-start=\"2363\" data-end=\"2409\" class=\"\"><strong data-start=\"2363\" data-end=\"2375\">À propos</strong> – Histoire, parcours de l’artisan</p>\r\n</li>\r\n<li data-start=\"2410\" data-end=\"2459\" class=\"\">\r\n<p data-start=\"2413\" data-end=\"2459\" class=\"\"><strong data-start=\"2413\" data-end=\"2425\">Services</strong> – Liste des prestations proposées</p>\r\n</li>\r\n<li data-start=\"2460\" data-end=\"2519\" class=\"\">\r\n<p data-start=\"2463\" data-end=\"2519\" class=\"\"><strong data-start=\"2463\" data-end=\"2489\">Galerie / Réalisations</strong> – Exemples de projets, photos</p>\r\n</li>\r\n<li data-start=\"2520\" data-end=\"2601\" class=\"\">\r\n<p data-start=\"2523\" data-end=\"2601\" class=\"\"><strong data-start=\"2523\" data-end=\"2534\">Contact</strong> – Formulaire, coordonnées, carte Google Maps (intégrée ou simulée)</p>\r\n</li>\r\n</ol><h4 data-start=\"2603\" data-end=\"2621\" class=\"\">Contraintes :</h4><ul data-start=\"2622\" data-end=\"2891\">\r\n<li data-start=\"2622\" data-end=\"2673\" class=\"\">\r\n<p data-start=\"2624\" data-end=\"2673\" class=\"\">Utiliser un <strong data-start=\"2636\" data-end=\"2653\">thème gratuit</strong> et le personnaliser</p>\r\n</li>\r\n<li data-start=\"2674\" data-end=\"2715\" class=\"\">\r\n<p data-start=\"2676\" data-end=\"2715\" class=\"\">Ajouter un <strong data-start=\"2687\" data-end=\"2715\">menu de navigation clair</strong></p>\r\n</li>\r\n<li data-start=\"2716\" data-end=\"2776\" class=\"\">\r\n<p data-start=\"2718\" data-end=\"2776\" class=\"\">Intégrer au moins <strong data-start=\"2736\" data-end=\"2748\">1 plugin</strong> (ex. formulaire de contact)</p>\r\n</li>\r\n<li data-start=\"2777\" data-end=\"2841\" class=\"\">\r\n<p data-start=\"2779\" data-end=\"2841\" class=\"\">Utiliser <strong data-start=\"2788\" data-end=\"2818\">des images libres de droit</strong> ou des images fournies</p>\r\n</li>\r\n<li data-start=\"2842\" data-end=\"2891\" class=\"\">\r\n<p data-start=\"2844\" data-end=\"2891\" class=\"\">Le contenu texte peut être fictif mais crédible</p>\r\n</li>\r\n</ul><h4 data-start=\"2893\" data-end=\"2918\" class=\"\">Bonus (facultatif) :</h4><p data-start=\"2216\" data-end=\"2289\" class=\"\">\r\n\r\n\r\n\r\n\r\n\r\n</p><ul data-start=\"2919\" data-end=\"3017\">\r\n<li data-start=\"2919\" data-end=\"2947\" class=\"\">\r\n<p data-start=\"2921\" data-end=\"2947\" class=\"\">Version responsive soignée</p>\r\n</li>\r\n<li data-start=\"2948\" data-end=\"2978\" class=\"\">\r\n<p data-start=\"2950\" data-end=\"2978\" class=\"\">Ajout de témoignages clients</p>\r\n</li>\r\n<li data-start=\"2979\" data-end=\"3017\" class=\"\">\r\n<p data-start=\"2981\" data-end=\"3017\" class=\"\">Animation légère (CSS ou via plugin)</p></li></ul>',NULL,2,3,2,'ddeeb662-8dd8-4aa1-8c44-f2940de09e84','2025-05-12 07:44:09','2025-05-12 07:44:09'),(52,'Site E-commerce en WordPress','<p data-start=\"249\" data-end=\"548\" class=\"\">Dans le cadre de ce projet, vous êtes missionnés par un client de&nbsp;<strong data-start=\"383\" data-end=\"420\">digitaliser son activité de vente</strong>. Cette entreprise, jusqu’alors limitée à la vente physique, souhaite élargir sa clientèle en lançant une <strong data-start=\"526\" data-end=\"547\">boutique en ligne</strong>.</p><p>\r\n</p><p data-start=\"550\" data-end=\"838\" class=\"\">Le client a un budget limité et souhaite une solution <strong data-start=\"604\" data-end=\"648\">rapide, flexible et facile à administrer</strong>. C’est pourquoi il opte pour un site e-commerce basé sur <strong data-start=\"706\" data-end=\"746\">WordPress avec le plugin WooCommerce</strong>. Il compte sur vous pour concevoir un site professionnel, sécurisé et adapté à ses besoins.</p>','<p>\r\n</p><p><p data-start=\"879\" data-end=\"928\" class=\"\"><b>Objectifs du projet:</b></p><ul><li><span style=\"font-size: 1rem;\">Installer et configurer WordPress et WooCommerce.</span></li></ul></p><ul data-start=\"877\" data-end=\"1336\">\r\n<li data-start=\"929\" data-end=\"994\" class=\"\">\r\n<p data-start=\"931\" data-end=\"994\" class=\"\">Créer une boutique fonctionnelle avec un catalogue de produits.</p>\r\n</li>\r\n<li data-start=\"995\" data-end=\"1061\" class=\"\">\r\n<p data-start=\"997\" data-end=\"1061\" class=\"\">Mettre en place des catégories, filtres et options de recherche.</p>\r\n</li>\r\n<li data-start=\"1062\" data-end=\"1124\" class=\"\">\r\n<p data-start=\"1064\" data-end=\"1124\" class=\"\">Créer un tunnel d’achat (panier, commande, paiement simulé).</p>\r\n</li>\r\n<li data-start=\"1125\" data-end=\"1168\" class=\"\">\r\n<p data-start=\"1127\" data-end=\"1168\" class=\"\">Intégrer un design moderne et responsive.</p>\r\n</li>\r\n<li data-start=\"1169\" data-end=\"1239\" class=\"\">\r\n<p data-start=\"1171\" data-end=\"1239\" class=\"\">Personnaliser le thème pour respecter l’identité visuelle du client.</p>\r\n</li>\r\n<li data-start=\"1240\" data-end=\"1336\" class=\"\">\r\n<p data-start=\"1242\" data-end=\"1336\" class=\"\">Proposer un tableau de bord simple pour la gestion des produits, des commandes et des clients.</p><p data-start=\"1242\" data-end=\"1336\" class=\"\"><span style=\"font-size: 1rem;\"><b>Scénarios au choix:</b></span></p><p data-start=\"1242\" data-end=\"1336\" class=\"\">Pour votre sujet,choisissez un de ces cas:</p><p data-start=\"1242\" data-end=\"1336\" class=\"\">\r\n</p><ol data-start=\"1495\" data-end=\"1819\">\r\n<li data-start=\"1495\" data-end=\"1578\" class=\"\">\r\n<p data-start=\"1498\" data-end=\"1578\" class=\"\"><strong data-start=\"1498\" data-end=\"1521\">Boutique artisanale</strong> (ex : vente de bijoux faits main, poteries, objets déco)</p>\r\n</li>\r\n<li data-start=\"1579\" data-end=\"1653\" class=\"\">\r\n<p data-start=\"1582\" data-end=\"1653\" class=\"\"><strong data-start=\"1582\" data-end=\"1606\">Épicerie fine locale</strong> (ex : produits du terroir, confitures, huiles)</p>\r\n</li>\r\n<li data-start=\"1654\" data-end=\"1734\" class=\"\">\r\n<p data-start=\"1657\" data-end=\"1734\" class=\"\"><strong data-start=\"1657\" data-end=\"1697\">Boutique de vêtements ou accessoires</strong> (mode urbaine, enfants, sport, etc.)</p>\r\n</li>\r\n<li data-start=\"1735\" data-end=\"1819\" class=\"\">\r\n<p data-start=\"1738\" data-end=\"1819\" class=\"\"><strong data-start=\"1738\" data-end=\"1764\">Librairie ou papeterie</strong> (livres, fournitures scolaires, carnets personnalisés)</p></li></ol>\r\n</li>\r\n</ul>',NULL,4,2,2,'8a842153-3447-4049-ba1a-4a327de307e7','2025-05-13 07:44:48','2025-05-13 07:44:48'),(53,'Projet de fin de formation','<p>Projet de fin de formation</p>','<p>Projet de fin de formation</p>',NULL,30,5,2,'4eec070b-d25f-4173-837d-8577012b11fd','2025-05-19 09:28:22','2025-05-19 09:28:22');
