e du rapport. Par exemple :</p><p>\r\n</p><blockquote data-start=\"1566\" data-end=\"1751\">\r\n<p data-start=\"1568\" data-end=\"1751\" class=\"\"><em data-start=\"1568\" data-end=\"1751\">Ce rapport détaille les différentes étapes de conception, de développement et de validation de ce module, en mettant l’accent sur l’expérience utilisateur et la sécurité du partage.</em></p></blockquote>',NULL,'2025-04-14 13:41:54','2025-05-19 13:42:34'),(1589,'2025-04-14 00:00:00','2025-04-16 00:00:00','6be4c5d2-9ca6-4930-a88d-98ee42e32471',95,3,NULL,28,36,'<p>Il faut travailler sur la page de garde</p>',NULL,'2025-04-14 13:41:54','2025-05-28 07:31:05'),(1591,'2025-04-28 00:00:00',NULL,'1c395e01-d71a-40bd-886f-bfdbff6cc588',95,3,NULL,30,36,'<p>absent</p>',NULL,'2025-04-14 13:41:54','2025-05-28 07:31:05'),(1592,'2025-04-17 00:00:00','2025-04-17 00:00:00','0d9bd766-7478-4497-af77-840bf4d9afb2',95,3,NULL,31,36,'<p><br></p><p><font color=\"#000000\" face=\"Arial\"><span style=\"font-size: 13.3333px;\">❌ Introduction absente ou incomplète → le texte est trop court pour une introduction complète</span></font></p><p><font color=\"#000000\" face=\"Arial\"><span style=\"font-size: 13.3333px;\">❌ Démarche générale absente ou non compréhensible → aucune mention de la méthode utilisée (Agile, UX Design, etc.)</span></font></p><p><font color=\"#000000\" face=\"Arial\"><span style=\"font-size: 13.3333px;\">❌ Absence de transition vers les chapitres suivants → il manque une phrase comme : « Ce rapport présente les différentes étapes de conception, développement et validation du projet. »</span></font></p><p><font color=\"#000000\" face=\"Arial\"><span style=\"font-size: 13.3333px;\">❌ Texte mal structuré&nbsp;</span></font></p>',NULL,'2025-04-14 13:41:54','2025-05-28 07:31:05'),(1593,'2025-04-29 00:00:00',NULL,'902a2aef-2ab1-4677-81eb-9fb406a8c4df',95,3,NULL,32,36,'<p data-start=\"49\" data-end=\"283\" class=\"\">❌ <strong data-start=\"51\" data-end=\"89\">Introduction absente ou incomplète</strong><br data-start=\"89\" data-end=\"92\">\r\n➤ Le texte explique le <strong data-start=\"115\" data-end=\"144\">sujet de manière générale</strong>, mais <strong data-start=\"151\" data-end=\"191\">ne présente pas le projet spécifique</strong>, ni le contexte réel dans lequel il est réalisé (ex. formation, plateforme Soli-LMS, etc.).</p><p data-start=\"285\" data-end=\"468\" class=\"\">❌ <strong data-start=\"287\" data-end=\"327\">Contexte non expliqué ou mal formulé</strong><br data-start=\"327\" data-end=\"330\">\r\n➤ Il n’est pas précisé <strong data-start=\"353\" data-end=\"378\">pour quel besoin réel</strong> ce travail a été mené, ni dans <strong data-start=\"410\" data-end=\"424\">quel cadre</strong> (établissement, module, utilisateur final).</p><p data-start=\"470\" data-end=\"651\" class=\"\">❌ <strong data-start=\"472\" data-end=\"511\">Objectif du projet flou ou manquant</strong><br data-start=\"511\" data-end=\"514\">\r\n➤ Le texte ne contient pas d’<strong data-start=\"543\" data-end=\"574\">objectif formulé clairement</strong>, tel que : <em data-start=\"586\" data-end=\"650\">\"Ce projet vise à développer une application permettant de...\"</em>.</p><p data-start=\"653\" data-end=\"817\" class=\"\">❌ <strong data-start=\"655\" data-end=\"706\">Démarche générale absente ou non compréhensible</strong><br data-start=\"706\" data-end=\"709\">\r\n➤ Aucune mention de <strong data-start=\"729\" data-end=\"751\">méthode de travail</strong> (Agile, UX Design, sprints...), ni de structure de développement.</p><p data-start=\"819\" data-end=\"992\" class=\"\">❌ <strong data-start=\"821\" data-end=\"871\">Absence d’illustration ou image non pertinente</strong><br data-start=\"871\" data-end=\"874\">\r\n❌ <strong data-start=\"876\" data-end=\"936\">Image sans titre, de mauvaise qualité ou mal positionnée</strong><br data-start=\"936\" data-end=\"939\">\r\n➤ Aucune image n’est mentionnée, insérée, ni décrite.</p><p>\r\n\r\n\r\n\r\n\r\n</p><p data-start=\"994\" data-end=\"1144\" class=\"\">❌ <strong data-start=\"996\" data-end=\"1049\">Absence de transition vers les chapitres suivants</strong><br data-start=\"1049\" data-end=\"1052\">\r\n➤ Le texte se termine de manière générale, sans annoncer la suite du rapport ou du document.</p>',NULL,'2025-04-14 13:41:54','2025-05-28 07:31:05'),(1594,'2025-04-14 00:00:00','2025-04-17 00:00:00','19f767f5-9d28-46b9-8e3d-7ab5c80288c5',95,3,NULL,33,36,'<p>Il faut travailler sur la page de garde</p>',NULL,'2025-04-14 13:41:54','2025-05-28 07:31:05'),(1595,'2025-04-17 00:00:00','2025-04-17 00:00:00','58ff85da-588c-49d5-abc6-01840dfb32d2',95,3,NULL,34,36,'<p>❌ Absence de transition vers les chapitres suivants (il manque une phrase de transition du type : \"Ce rapport décrit...\")</p>',NULL,'2025-04-14 13:41:54','2025-05-28 07:31:06'),(1596,'2025-04-14 00:00:00',NULL,'4af16734-1b5d-4cde-b3e6-51b267b024ea',95,3,NULL,35,36,'<p>L\'image doit être après le titre</p>',NULL,'2025-04-14 13:41:54','2025-05-28 07:31:06'),(1598,'2025-04-17 00:00:00',NULL,'bd93affb-97e8-4f8d-b936-22218c1a6865',95,3,NULL,37,36,'<p>❌ Absence de transition vers les chapitres suivants</p><p>➤ Ajoute une phrase comme : « Ce rapport détaille les étapes de conception, de développement et de validation du module. »</p>',NULL,'2025-04-14 13:41:54','2025-05-28 07:31:06'),(1599,'2025-04-17 00:00:00',NULL,'02f36484-370c-4685-a282-b9ca55f2290d',95,3,NULL,38,36,'<p>voir la tâche page de garde</p>',NULL,'2025-04-14 13:41:54','2025-05-28 07:31:06'),(1600,'2025-04-29 00:00:00',NULL,'318aa93b-a6ae-4f11-80ab-583c92383422',96,5,NULL,20,36,'<p>Le temps de la tâche est terminé</p>',NULL,'2025-04-14 14:00:22','2025-05-28 07:32:46'),(1601,'2025-04-29 00:00:00',NULL,'25e8d317-26f1-447f-a9f8-f59888b35f54',96,5,NULL,21,36,'<p>Le chapitre&nbsp;Development process&nbsp; est vide</p>',NULL,'2025-04-14 14:00:22','2025-05-28 07:32:47'),(1602,'2025-04-16 00:00:00',NULL,'12b4d543-ffe5-4bac-96e1-fb2e4ba58cab',96,5,NULL,22,36,'<p>Remerciement est vide</p>',NULL,'2025-04-14 14:00:22','2025-05-28 07:32:47'),(1603,'2025-04-16 00:00:00',NULL,'b783e790-c9f8-49f8-b04d-1221317c09cd',96,5,NULL,23,36,'<p>le durée de la tâche est terminée</p>',NULL,'2025-04-14 14:00:22','2025-05-28 07:32:47'),(1604,'2025-04-16 00:00:00',NULL,'bfd18928-27a8-4ca9-bac1-feff51f767c3',96,5,NULL,24,36,'<p>La table des matières n\'est pas valide</p>',NULL,'2025-04-14 14:00:22','2025-05-28 07:32:47'),(1605,'2025-04-16 00:00:00','2025-04-17 00:00:00','b23cc8f4-caaa-4241-b22a-de3858249f24',96,0,NULL,25,39,NULL,NULL,'2025-04-14 14:00:22','2025-05-28 07:32:25'),(1606,'2025-04-28 00:00:00',NULL,'5cacfc9e-4d17-4d60-9768-8414a3970ea6',96,0,NULL,26,39,'<ul data-line=\"47\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;; padding-left: 2em; position: relative;\"><li data-line=\"48\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Description trop théorique, sans lien avec le projet réel</li><li data-line=\"51\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Rôles dans l’équipe non mentionnés ou mal définis</li><li data-line=\"51\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">image doit avoir un titre</li></ul>',NULL,'2025-04-14 14:00:22','2025-05-19 14:15:23'),(1608,'2025-04-14 00:00:00','2025-04-17 00:00:00','c673b7b7-743e-406a-a74d-7de608c1392a',96,5,NULL,28,36,'<p>Le contenu est présenté sous forme de listes à puces ou d’éléments isolés. Il est impératif de rédiger des <strong data-start=\"285\" data-end=\"311\">paragraphes structurés</strong> dans un rapport écrit, afin d\'assurer la fluidité de la lecture et la cohérence de l’argumentation.</p>',NULL,'2025-04-14 14:00:22','2025-05-28 07:32:47'),(1610,'2025-04-28 00:00:00',NULL,'b3aad845-a668-4478-9c50-a05445f863f6',96,5,NULL,30,36,'<p>Supprimer les espaces avant les titres</p>',NULL,'2025-04-14 14:00:22','2025-05-28 07:32:47'),(1611,'2025-04-30 00:00:00',NULL,'d715cd99-6a72-40e9-a525-66c2733f940a',96,5,NULL,31,36,'<p>Le contenu est présenté sous forme de listes à puces ou d’éléments isolés. Il est impératif de rédiger des <strong data-start=\"285\" data-end=\"311\">paragraphes structurés</strong> dans un rapport écrit, afin d\'assurer la fluidité de la lecture et la cohérence de l’argumentation.</p>',NULL,'2025-04-14 14:00:22','2025-05-28 07:32:47'),(1612,'2025-04-29 00:00:00',NULL,'7b0c761c-bdc0-422e-bde4-68b0ff742d55',96,3,NULL,32,3,'<p>chaque chapitre doit se terminé par une conclusion</p>',NULL,'2025-04-14 14:00:22','2025-05-21 10:22:23'),(1613,'2025-04-29 00:00:00',NULL,'cd43a7ae-5228-4a25-8952-7bc9fd485485',96,5,NULL,33,36,'<ul><li>Le contenu est présenté sous forme de listes à puces ou d’éléments isolés. Il est impératif de rédiger des <strong data-start=\"285\" data-end=\"311\">paragraphes structurés</strong> dans un rapport écrit, afin d\'assurer la fluidité de la lecture et la cohérence de l’argumentation.</li></ul>',NULL,'2025-04-14 14:00:22','2025-05-28 07:32:47'),(1614,'2025-04-17 00:00:00',NULL,'29850d80-5f5a-4224-bdb8-05f036c20b58',96,2,NULL,34,39,'<p>chaque chapitre doit avoir une conclusion</p><p>le chapitre UX n\'est pas valide.</p>',NULL,'2025-04-14 14:00:22','2025-05-19 14:15:04'),(1615,'2025-04-14 00:00:00',NULL,'38e71a1c-7f64-4b09-b057-bbed2f8dd9c0',96,5,NULL,35,36,'<p><span data-sheets-root=\"1\" style=\"color: rgb(0, 0, 0); font-size: 10pt; font-family: Arial;\">Présence d\'espaces inutile</span></p>',NULL,'2025-04-14 14:00:22','2025-05-28 07:32:47'),(1617,'2025-04-29 00:00:00',NULL,'e4c57a4d-4da4-4605-a621-9d2f1fb2e28b',96,3,NULL,37,39,'chaque chapitre doit avoir une introduction',NULL,'2025-04-14 14:00:22','2025-05-19 14:14:49'),(1618,'2025-04-17 00:00:00',NULL,'fc053fab-8b09-4942-806f-0c19e73fb97a',96,0,NULL,38,39,'<ul data-line=\"47\" c