'),(12,'Gestion des autoformations','PkgAutoformation','Contient les tables PkgAutoformation',1,11,'1',6,'PkgAutoformation','2025-04-02 08:54:04','2025-04-07 06:44:42'),(13,'Gestion des notification','PkgNotification','Contient les tables PkgNotification',1,11,'1',6,'PkgNotification','2025-05-12 06:42:30','2025-05-12 06:42:30'),(14,'Evaluation de projets','PkgValidationProjets','Contient les tables PkgValidationProjets',1,12,'1',6,'PkgValidationProjets','2025-05-19 07:17:55','2025-05-19 07:17:55');
