INSERT INTO `taches` VALUES (4,'Diagramme de cas d\'utilisation - sprint 1','<h1 data-line=\"0\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-diagramme-de-cas-dutilisation-%E2%80%93-sprint-1\" style=\"margin: 24px 0px 16px; font-weight: 600; line-height: 1.25; font-size: 2em; padding-bottom: 0.3em; border-bottom: 1px solid rgb(234, 236, 239); border-top-color: rgba(0, 0, 0, 0.18); border-right-color: rgba(0, 0, 0, 0.18); border-left-color: rgba(0, 0, 0, 0.18); position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🗂️ Diagramme de cas d\'utilisation – Sprint 1</h1><h2 data-line=\"2\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%84-r%C3%A9sum%C3%A9-de-la-t%C3%A2che\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.5em; padding-bottom: 0.3em; border-bottom: 1px solid rgb(234, 236, 239); border-top-color: rgba(0, 0, 0, 0.18); border-right-color: rgba(0, 0, 0, 0.18); border-left-color: rgba(0, 0, 0, 0.18); position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📄 Résumé de la tâche</h2><p data-line=\"4\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Ce diagramme représente les&nbsp;<span style=\"font-weight: 600;\">interactions principales</span>&nbsp;entre les utilisateurs (acteurs) et le système lors du&nbsp;<span style=\"font-weight: 600;\">Sprint 1</span>. Il sert à identifier les&nbsp;<span style=\"font-weight: 600;\">fonctionnalités prioritaires</span>&nbsp;à implémenter au cours de cette première itération. Il est basé sur les besoins fonctionnels définis dans le cahier des charges.</p><hr data-line=\"6\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h2 data-line=\"8\" class=\"code-line\" dir=\"auto\" id=\"%E2%9C%85-contenu-minimal-attendu\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.5em; padding-bottom: 0.3em; border-bottom: 1px solid rgb(234, 236, 239); border-top-color: rgba(0, 0, 0, 0.18); border-right-color: rgba(0, 0, 0, 0.18); border-left-color: rgba(0, 0, 0, 0.18); position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅ Contenu minimal attendu</h2><ol data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\"><p data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Liste des acteurs</span></p><blockquote data-line=\"11\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"11\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Identifier clairement les rôles qui interagissent avec le système (ex. Apprenant, Formateur, Administrateur…).</p></blockquote></li><li data-line=\"13\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"13\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Cas d’utilisation principaux du Sprint 1</span></p><blockquote data-line=\"14\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"14\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Chaque fonctionnalité prévue pendant ce sprint doit être représentée (ex. s’inscrire, se connecter, créer un projet...).</p></blockquote></li><li data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Diagramme UML propre et lisible</span></p><blockquote data-line=\"17\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"17\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Utiliser un outil adapté (ex. Mermaid, PlantUML) et insérer l’image dans le rapport avec une légende.</p></blockquote></li><li data-line=\"19\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"19\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Légende ou description des cas</span>&nbsp;(facultatif mais recommandé)</p><blockquote data-line=\"20\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"20\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Une brève explication textuelle des cas d’utilisation pour faciliter la lecture.</p></blockquote></li></ol><hr data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h2 data-line=\"25\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%9D-feedbacks-possibles\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.5em; padding-bottom: 0.3em; border-bottom: 1px solid rgb(234, 236, 239); border-top-color: rgba(0, 0, 0, 0.18); border-right-color: rgba(0, 0, 0, 0.18); border-left-color: rgba(0, 0, 0, 0.18); position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📝 Feedbacks possibles</h2><ul data-line=\"27\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"27\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Diagramme absent ou non inséré dans le rapport</li><li data-line=\"28\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Acteurs non identifiés ou mal nommés</li><li data-line=\"29\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Cas d’utilisation flous, incomplets ou hors du périmètre du Sprint 1</li><li data-line=\"30\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Image floue, mal cadrée ou sans légende</li><li data-line=\"31\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Non-respect des conventions UML (relations, noms, limites du système)</li><li data-line=\"32\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucune description ni interprétation du diagramme</li><li data-line=\"33\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Titre de la figure absent ou incorrect</li><li data-line=\"34\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Cas trop nombreux ou non pertinents pour ce sprint</li></ul><hr data-line=\"36\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h2 data-line=\"38\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%92%A1-bonnes-pratiques\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.5em; padding-bottom: 0.3em; border-bottom: 1px solid rgb(234, 236, 239); border-top-color: rgba(0, 0, 0, 0.18); border-right-color: rgba(0, 0, 0, 0.18); border-left-color: rgba(0, 0, 0, 0.18); position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">💡 Bonnes pratiques</h2><ul data-line=\"40\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"40\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Numéroter les figures :&nbsp;<em>Figure 1, Figure 2, etc.</em></li><li data-line=\"41\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Utiliser des noms d’action clairs pour les cas (ex. « Ajouter un projet » au lieu de « Projet »)</li><li data-line=\"42\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Garder le diagramme simple et centré sur les&nbsp;<span style=\"font-weight: 600;\">fonctionnalités réellement implémentées durant le sprint</span></li></ul>',NULL,'2025-05-19 11:00:00','72e7a341-e3f9-44c6-8377-97a4eb0fbfd8',7,21,3,10,'2025-03-03 10:04:41','2025-05-22 09:13:24'),(5,'Conception du système','<h3 data-line=\"0\" class=\"code-line code-active-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-conception-du-syst%C3%A8me\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🗂️&nbsp;Conception du système</h3><h4 data-line=\"2\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%84-description-de-la-t%C3%A2che\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📄&nbsp;Description de la tâche</h4><p data-line=\"4\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">La&nbsp;<span style=\"font-weight: 600;\">conception du système</span>&nbsp;constitue une étape essentielle du projet. Elle permet de&nbsp;<span style=\"font-weight: 600;\">traduire les besoins fonctionnels</span>&nbsp;en une structure technique et visuelle claire, avant le début du développement.</p><p data-line=\"6\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Elle regroupe deux volets complémentaires :</p><hr data-line=\"8\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h4 data-line=\"10\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%94%B7-1-conception-technique-%E2%80%93-diagramme-de-classes-uml\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🔷&nbsp;1. Conception technique – Diagramme de classes UML</h4><p data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Le&nbsp;<span style=\"font-weight: 600;\">diagramme de classes</span>&nbsp;modélise les&nbsp;<span style=\"font-weight: 600;\">entités du système</span>, leurs&nbsp;<span style=\"font-weight: 600;\">attributs</span>, leurs&nbsp;<span style=\"font-weight: 600;\">relations</span>, et parfois leurs&nbsp;<span style=\"font-weight: 600;\">méthodes</span>. Il constitue une base de réflexion pour la structure de la base de données ou des objets métiers.</p><p data-line=\"14\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅ Ce diagramme doit :</p><ul data-line=\"15\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"15\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Représenter les classes principales (ex. Utilisateur, Projet, Tâche, Livrable…)</li><li data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Définir les relations (association, héritage, composition…)</li><li data-line=\"17\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Respecter la&nbsp;<span style=\"font-weight: 600;\">notation UML</span></li><li data-line=\"18\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Être lisible et légendé dans le rapport (ex :&nbsp;<em>Figure X : Diagramme de classes</em>)</li></ul><hr data-line=\"20\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h4 data-line=\"22\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%94%B7-2-conception-visuelle-%E2%80%93-maquettes-uiux\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🔷&nbsp;2. Conception visuelle – Maquettes (UI/UX)</h4><p data-line=\"24\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Les&nbsp;<span style=\"font-weight: 600;\">maquettes d’interface</span>&nbsp;illustrent l’expérience utilisateur à travers une ou plusieurs vues de l’application. Elles permettent de&nbsp;<span style=\"font-weight: 600;\">visualiser l’organisation des écrans</span>, la&nbsp;<span style=\"font-weight: 600;\">navigation</span>, les&nbsp;<span style=\"font-weight: 600;\">éléments interactifs</span>, et de valider le design avant la mise en œuvre.</p><p data-line=\"26\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅ Les maquettes doivent :</p><ul data-line=\"27\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"27\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Couvrir les principales interfaces du projet (ex : Accueil, Connexion, Liste des projets, Détail d’un élément…)</li><li data-line=\"28\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Être&nbsp;<span style=\"font-weight: 600;\">propres, cohérentes et alignées avec les fonctionnalités prévues</span></li><li data-line=\"29\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Inclure un&nbsp;<span style=\"font-weight: 600;\">titre pour chaque maquette</span></li><li data-line=\"30\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Être accompagnées d’un&nbsp;<span style=\"font-weight: 600;\">court commentaire expliquant les choix UX/UI</span></li></ul><hr data-line=\"32\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h3 data-line=\"34\" class=\"code-line\" dir=\"auto\" id=\"%E2%9C%85-contenu-minimal-attendu\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅&nbsp;Contenu minimal attendu</h3><ul data-line=\"36\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"36\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Un&nbsp;<span style=\"font-weight: 600;\">diagramme de classes UML</span>&nbsp;propre, structuré et annoté</li><li data-line=\"37\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Au moins&nbsp;<span style=\"font-weight: 600;\">2 à 3 maquettes d’écrans clés</span>, avec titres et descriptions</li><li data-line=\"38\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Une&nbsp;<span style=\"font-weight: 600;\">cohérence entre les entités du diagramme</span>&nbsp;et les vues présentées</li><li data-line=\"39\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Une&nbsp;<span style=\"font-weight: 600;\">brève justification des choix de conception</span>&nbsp;(techniques et visuels)</li></ul><hr data-line=\"41\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h3 data-line=\"43\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%9D-feedbacks-possibles\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📝&nbsp;Feedbacks possibles</h3><h4 data-line=\"45\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%9F%A6-diagramme-de-classes\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🟦&nbsp;<em>Diagramme de classes</em></h4><ul data-line=\"46\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"46\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Diagramme absent ou non intégré dans le rapport</li><li data-line=\"47\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Relations entre classes mal définies ou non respectées</li><li data-line=\"48\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Attributs insuffisants ou non en lien avec les cas d’utilisation</li><li data-line=\"49\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Utilisation incorrecte de la notation UML</li><li data-line=\"50\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Diagramme flou, illisible ou sans légende</li><li data-line=\"51\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucune explication sur les entités ou leur rôle dans le projet</li></ul><h4 data-line=\"53\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%9F%A9-maquettes-uiux\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🟩&nbsp;<em>Maquettes UI/UX</em></h4><ul data-line=\"54\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"54\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Maquettes absentes ou non finalisées</li><li data-line=\"55\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Écrans incohérents avec les besoins exprimés</li><li data-line=\"56\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucune indication sur les éléments fonctionnels visibles</li><li data-line=\"57\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Manque de lisibilité (texte minuscule, couleurs peu lisibles, mauvaise résolution)</li><li data-line=\"58\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucune légende ou titre pour les maquettes</li><li data-line=\"59\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Maquettes trop générales ou réutilisées sans lien avec le projet</li></ul><h4 data-line=\"61\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%9F%A5-conception-globale\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🟥&nbsp;<em>Conception globale</em></h4><ul data-line=\"62\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"62\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Aucun lien entre la structure technique (classes) et les vues utilisateur (maquettes)</li><li data-line=\"63\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Absence de justification des choix (techniques ou ergonomiques)</li><li data-line=\"64\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Incohérence entre la conception et les fonctionnalités développées dans les sprints</li><li data-line=\"65\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Contenu copié sans adaptation au projet</li><li data-line=\"66\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Présentation désorganisée : pas de séparation claire entre diagramme et maquettes</li></ul>',NULL,'2025-05-19 16:30:00','aecb0191-84fe-47f2-9743-fa661f996121',9,21,6,12,'2025-03-03 10:05:05','2025-05-22 09:14:10'),(8,'Multi langue - lab',NULL,NULL,NULL,'5cbb806a-c5e3-404d-ab54-2288a2fbef8d',28,28,NULL,2,'2025-03-03 12:22:18','2025-04-28 14:49:56'),(9,'Filtre - lab',NULL,NULL,NULL,'1d9ec65e-cb61-4338-b3d2-bee64e4e8621',29,28,NULL,6,'2025-03-03 12:22:42','2025-04-28 14:49:56'),(10,'Requête Classe - lab',NULL,NULL,NULL,'ed17a66d-ec61-46b2-b35a-c46ddfde2afb',30,28,NULL,3,'2025-03-03 12:23:14','2025-04-28 14:49:56'),(11,'Module Laravel - lab',NULL,NULL,NULL,'29599473-633c-4b03-a299-98d869672caf',31,28,NULL,5,'2025-03-03 12:23:29','2025-04-28 14:49:56'),(12,'Import/Export - lab',NULL,NULL,NULL,'7447a086-9ac3-4b99-aa22-f616bbdb2d1e',32,28,NULL,6,'2025-03-03 12:23:46','2025-04-28 14:49:56'),(13,'Unit test - lab',NULL,NULL,NULL,'dd5e7ea8-7c07-45cd-a8f8-278bd8cb3a00',33,28,NULL,11,'2025-03-03 12:24:06','2025-04-