 des livrables.</p>\r\n</li>\r\n<li>\r\n<p>Développer l’esprit critique et la capacité de <strong>justification technique</strong>.</p>\r\n</li>\r\n<li>\r\n<p>Utiliser des outils de gestion de projet comme <strong>GitHub Issues</strong> et <strong>Projets</strong> pour le suivi.</p>\r\n</li>\r\n</ul><hr><h3>📋 <strong>Sous-tâches</strong> :</h3><ul class=\"contains-task-list\">\r\n<li class=\"task-list-item\">\r\n<p><input type=\"checkbox\" disabled=\"\"> Créer un ticket GitHub <strong>Sprint Review - Semaine [X]</strong> dans le tableau du projet.</p>\r\n</li>\r\n<li class=\"task-list-item\">\r\n<p><input type=\"checkbox\" disabled=\"\"> Préparer une <strong>présentation rapide</strong> (10 min) du projet, des user stories terminées et des difficultés rencontrées.</p>\r\n</li>\r\n<li class=\"task-list-item\">\r\n<p><input type=\"checkbox\" disabled=\"\"> <strong>Lister les issues</strong> terminées (fermeture automatique ou manuelle).</p>\r\n</li>\r\n<li class=\"task-list-item\">\r\n<p><input type=\"checkbox\" disabled=\"\"> Évaluer chaque issue livrée avec l’équipe et identifier les bugs ou ajustements nécessaires.</p>\r\n</li>\r\n<li class=\"task-list-item\">\r\n<p><input type=\"checkbox\" disabled=\"\"> Créer de <strong>nouvelles issues</strong> pour les améliorations ou bugs identifiés.</p>\r\n</li>\r\n<li class=\"task-list-item\">\r\n<p><input type=\"checkbox\" disabled=\"\"> Mettre à jour le <strong>Project Board</strong> (kanban) : marquer les tâches terminées, réorganiser les priorités.</p>\r\n</li>\r\n<li class=\"task-list-item\">\r\n<p><input type=\"checkbox\" disabled=\"\"> Ajouter un <strong>commentaire de synthèse</strong> dans l’issue de Sprint Review (ce qui a été fait, ce qui reste, les feedbacks, etc.).</p>\r\n</li>\r\n</ul><hr><h3>🛠️ <strong>Ressources utilisées</strong></h3><ul>\r\n<li>\r\n<p>Issues GitHub pour le suivi des tâches.</p>\r\n</li>\r\n<li>\r\n<p>GitHub Projects pour le tableau de gestion.</p>\r\n</li>\r\n<li>\r\n<p>Cahier des charges ou backlog comme référence.</p></li></ul><h3>🎓 <strong>Niveau concerné</strong> : 🟠 <strong>Avancé (N3)</strong></h3>','2025-04-21 00:00:00','2025-04-27 00:00:00','6073502c-3e21-4fb3-8227-7c8160eb59a4',79,40,NULL,2,'2025-04-08 07:13:08','2025-04-28 14:49:56'),(74,'Autoformation:WordPress','<p><a href=\"https://tutoriels.lws.fr/wordpress/tuto-wordpress\" target=\"_blank\">Tutoriel WordPress</a></p>',NULL,NULL,'7254e5d7-4b89-43d2-824c-5a29ff7f9926',80,42,NULL,15,'2025-04-08 09:54:19','2025-04-28 14:49:56'),(75,'Choisir un hébergeur et configurer votre site WordPress',NULL,NULL,NULL,'e1523071-8352-4e04-9487-16f294714091',81,42,NULL,16,'2025-04-08 09:55:12','2025-04-28 14:49:56'),(76,'Personnaliser votre site',NULL,NULL,NULL,'488972f7-4e7a-4d88-8ef0-d99ad50cfbad',82,42,NULL,17,'2025-04-08 09:56:31','2025-04-28 14:49:56'),(77,'Installation et configuration des plugins',NULL,NULL,NULL,'34789362-6b26-469c-b92a-76ebaafc5b49',83,42,NULL,17,'2025-04-08 09:57:04','2025-04-28 14:49:56'),(78,'Livrer le projet',NULL,NULL,NULL,'42700dcd-e71a-4781-ae31-e82f273ededa',84,35,NULL,9,'2025-04-09 09:54:23','2025-04-28 14:49:56'),(79,'Livrer le projet',NULL,NULL,NULL,'0aa7abb5-bbd6-465d-b970-19ebcc67f1d5',85,36,NULL,9,'2025-04-09 09:55:03','2025-04-28 14:49:56'),(80,'PHP Connect to MySQL',NULL,NULL,NULL,'c3e2925f-b6fd-43b3-b9cd-ce60aa4ffc2a',86,43,NULL,18,'2025-04-09 11:54:36','2025-04-28 14:49:56'),(81,'PHP Create a MySQL Database',NULL,NULL,NULL,'0b9a5e9d-3dfc-430d-b32e-c4f6283a6933',87,43,NULL,19,'2025-04-09 11:55:00','2025-04-28 14:49:56'),(83,'PHP MySQL Insert Data',NULL,NULL,NULL,'86dbf8ab-0193-4315-85a4-6db501ae1a64',88,43,NULL,20,'2025-04-09 11:57:32','2025-04-28 14:49:56'),(84,'PHP MySQL Get Last Inserted ID',NULL,NULL,NULL,'e2fdb643-231d-4f92-a4df-2d413c190a1c',89,43,NULL,21,'2025-04-09 11:58:09','2025-04-28 14:49:56'),(85,'PHP MySQL Insert Multiple Records',NULL,NULL,NULL,'1b891167-d24d-46c3-8f90-1fbe01c16366',90,43,NULL,22,'2025-04-09 11:58:49','2025-04-28 14:49:56'),(86,'PHP 