; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Le cahier des charges définit les&nbsp;<span style=\"font-weight: 600;\">besoins fonctionnels et techniques</span>&nbsp;du projet. Il sert de référence tout au long de la réalisation et permet de s’assurer que les objectifs sont bien compris et respectés. Il doit décrire ce que le système doit faire, pour qui, et dans quelles conditions, sans entrer dans les détails de l’implémentation.</p><hr data-line=\"5\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h4 data-line=\"7\" class=\"code-line\" dir=\"auto\" id=\"%E2%9C%85-contenu-minimal-attendu\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅&nbsp;Contenu minimal attendu</h4><ol data-line=\"9\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"9\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\"><p data-line=\"9\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Objectif du projet</span></p><blockquote data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Reformulation claire et concise de l’objectif du projet, en lien avec la problématique identifiée.</p></blockquote></li><li data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Utilisateurs cibles</span></p><blockquote data-line=\"13\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"13\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Description des utilisateurs finaux ou parties prenantes concernées (ex. apprenants, formateurs, clients…).</p></blockquote></li><li data-line=\"15\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"15\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Fonctionnalités principales</span></p><blockquote data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Liste des fonctionnalités attendues (minimum 4 à 5), sous forme de points clairs (ex. ajouter un utilisateur, consulter les résultats…).</p></blockquote></li><li data-line=\"18\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"18\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Contraintes techniques ou fonctionnelles</span></p><blockquote data-line=\"19\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"19\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Éléments imposés par le contexte : technologies à utiliser, format du livrable, contraintes de temps ou de sécurité…</p></blockquote></li><li data-line=\"21\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"21\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Livrables attendus</span></p><blockquote data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Ce qui doit être produit à la fin du projet : application, documentation, présentation, etc.</p></blockquote></li><li data-line=\"24\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"24\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Planification globale (facultatif dans la version minimale)</span></p><blockquote data-line=\"25\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"25\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Mention du nombre de sprints ou phases (ex. Sprint 1 : analyse, Sprint 2 : développement…).</p></blockquote></li></ol><hr data-line=\"27\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h4 data-line=\"29\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%9D-feedbacks-possibles\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📝&nbsp;Feedbacks possibles</h4><ul data-line=\"31\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"31\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Cahier des charges absent ou non rédigé</li><li data-line=\"32\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Objectif du projet non reformulé ou incohérent</li><li data-line=\"33\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Utilisateurs non identifiés ou mal définis</li><li data-line=\"34\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Liste de fonctionnalités trop vague ou incomplète</li><li data-line=\"35\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Absence de contraintes techniques ou fonctionnelles</li><li data-line=\"36\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Livrables non précisés ou mal définis</li><li data-line=\"37\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Contenu confus ou mal structuré</li><li data-line=\"38\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Absence de titres ou de sous-titres pour organiser le texte</li><li data-line=\"39\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Informations redondantes avec d\'autres sections</li><li data-line=\"40\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Fautes d’orthographe ou de grammaire</li></ul>',NULL,'2025-05-16 12:00:00','16b6c1e0-4aa1-4247-8915-c2e0e3f3a511',5,21,3,6,'2025-04-14 13:37:48','2025-05-22 07:16:25'),(94,'Page de gard','<h3 data-line=\"0\" class=\"code-line code-active-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-1-page-de-garde\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🗂️&nbsp;1. Page de garde</h3><h4 data-line=\"2\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%84-r%C3%A9sum%C3%A9-de-la-t%C3%A2che\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📄&nbsp;Résumé de la tâche</h4><p data-line=\"3\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">La page de garde constitue la première impression du rapport. Elle doit être&nbsp;<span style=\"font-weight: 600;\">claire, professionnelle et uniforme</span>&nbsp;pour l’ensemble des apprenants d’une même classe. Elle doit inclure les éléments suivants :</p><ul data-line=\"5\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"5\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Titre complet du projet</li><li data-line=\"6\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Logo de l’OFPPT et de l’établissement (ex : Solicode)</li><li data-line=\"7\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Nom complet de l’apprenant</li><li data-line=\"8\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Nom complet de l’encadrant pédagogique</li><li data-line=\"9\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Année de formation</li><li data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Spécialité ou filière</li><li data-line=\"11\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Date de dépôt ou de soutenance</li><li data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Mise en page soignée et alignée</li><li data-line=\"13\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Utilisation d’un modèle uniforme (même charte graphique pour tous les apprenants)</li></ul><h4 data-line=\"15\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%9D-feedbacks-possibles\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📝&nbsp;Feedbacks possibles</h4><ul data-line=\"17\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"17\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Page de garde absente</li><li data-line=\"17\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Page non conforme</li><li data-line=\"18\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Utilisation d’un ancien logo ou d’un logo incorrect de l’OFPPT</li><li data-line=\"19\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Logo de l’établissement (ex : Solicode) manquant</li><li data-line=\"20\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Logos mal positionnés ou mal dimensionnés</li><li data-line=\"21\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Absence du nom de l’encadrant ou erreur dans son orthographe</li><li data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Informations incomplètes (ex. spécialité, année de formation, date de soutenance...)</li><li data-line=\"23\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Titre du projet incorrect, incomplet ou mal formulé</li><li data-line=\"24\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Mise en page non professionnelle (alignements, marges, typographie)</li><li data-line=\"25\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Charte graphique non respectée entre les membres du groupe (modèles différents)</li><li data-line=\"26\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Texte trop petit ou trop grand, mal lisible</li><li data-line=\"27\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Fautes d’orthographe ou de grammaire</li></ul>','2025-05-14 09:00:00','2025-05-14 13:00:00','053aee6e-f63e-4067-9761-d5041eec602b',1,21,3,2,'2025-04-14 13:40:10','2025-05-19 07:25:39'),(95,'Introduction','<h3 data-line=\"0\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-2-introduction\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🗂️&nbsp;2. Introduction</h3><h4 data-line=\"2\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%84-r%C3%A9sum%C3%A9-de-la-t%C3%A2che\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📄&nbsp;Résumé de la tâche</h4><p data-line=\"3\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">L’introduction est la première section rédigée du rapport. Elle sert à contextualiser le projet, à en expliquer les objectifs et à introduire brièvement la démarche adoptée pour le réaliser. Elle doit être claire, structurée et visuellement soignée. Une&nbsp;<span style=\"font-weight: 600;\">image illustrative</span>&nbsp;est fortement recommandée (logo, schéma, photo...).</p><hr data-line=\"5\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h4 data-line=\"7\" class=\"code-line\" dir=\"auto\" id=\"%E2%9C%85-contenu-minimal-attendu\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅&nbsp;Contenu minimal attendu</h4><ol data-line=\"9\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"9\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\"><p data-line=\"9\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Contexte du projet</span></p><blockquote data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Expliquer brièvement dans quel cadre le projet est réalisé (formation, module, besoin réel…).</p></blockquote></li><li data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Objectif principal</span></p><blockquote data-line=\"13\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"13\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Présenter clairement l’objectif central du projet (ce qu’il vise à accomplir ou résoudre).</p></blockquote></li><li data-line=\"15\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"15\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Démarche générale</span></p><blockquote data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Décrire en une ou deux phrases la méthode adoptée pour mener le projet (ex. découpage en sprints, travail en équipe, méthode agile...).</p></blockquote></li><li data-line=\"18\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"18\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Image illustrative</span></p><blockquote data-line=\"19\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"19\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Insérer une image liée au projet avec un titre (logo, icône, photo, etc.).</p></blockquote></li><li data-line=\"21\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"21\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Phrase de transition</span></p><blockquote data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Annoncer la suite du document (ex. \"Ce rapport présente les étapes de conception, de développement et d’évaluation du projet.\").</p></blockquote></li></ol><hr data-line=\"24\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h4 data-line=\"26\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%9D-feedbacks-possibles\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📝&nbsp;Feedbacks possibles</h4><ul data-line=\"28\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"28\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Introduction absente ou incomplète</li><li data-line=\"29\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Contexte non expliqué ou mal formulé</li><li data-line=\"30\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Objectif du projet flou ou manquant</li><li data-line=\"31\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Démarche générale absente ou non compréhensible</li><li data-line=\"32\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Absence d’illustration ou image non pertinente</li><li data-line=\"33\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Image sans titre, de mauvaise qualité ou mal positionnée</li><li data-line=\"34\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Texte mal structuré ou désorganisé</li><li data-line=\"35\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Absence de transition vers les chapitres suivants</li><li data-line=\"36\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Fautes d’orthographe ou de grammaire</li><li data-line=\"37\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Contenu redondant ou hors sujet</li><li data-line=\"38\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Ton inapproprié pour une introduction académique</li></ul>','2025-05-14 09:00:00','2025-05-14 13:00:00','32da46bc-68f4-462c-a306-887c8ad294c2',3,21,3,4,'2025-04-14 13:41:54','2025-05-19 13:42:56'),(96,'Méthodologie du projet','<h3 data-line=\"0\" class=\"code-line code-active-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-m%C3%A9thodologie-du-projet-design-thinking--agile\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🗂️&nbsp;Méthodologie du projet (Design Thinking + Agile)</h3><h4 data-line=\"2\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%84-r%C3%A9sum%C3%A9-de-la-t%C3%A2che\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📄&nbsp;Résumé de la tâche</h4><h3 data-line=\"0\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-m%C3%A9thodologie-du-projet-design-thinking--agile\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><p data-line=\"3\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; font-size: 16px; font-weight: 400;\">Cette section décrit la&nbsp;<span style=\"font-weight: 600;\">démarche méthodologique</span>&nbsp;adoptée pour piloter le projet. Elle combine deux approches complémentaires :</p><ul data-line=\"4\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; font-size: 16px; font-weight: 400;\"><li data-line=\"4\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\"><span style=\"font-weight: 600;\">Design Thinking</span>, utilisée dans la phase d’idéation et de prototypage,</li><li data-line=\"5\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Méthode Agile (Scrum)</span>, adoptée pour le développement itératif du produit.</li></ul><hr data-line=\"7\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; font-size: 16px; font-weight: 400;\"></h3><h3 data-line=\"9\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%94%B7-31-design-thinking--une-approche-centr%C3%A9e-utilisateur\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🔷&nbsp;3.1. Design Thinking : une approche centrée utilisateur</h3><h3 data-line=\"0\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><blockquote data-line=\"11\" class=\"code-line\" dir=\"auto\" style=\"border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative; font-size: 16px; font-weight: 400;\"><p data-line=\"11\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Le Design Thinking a guidé la phase de réflexion initiale. L’objectif était de bien comprendre les besoins réels avant de concevoir une solution.</p></blockquote></h3><h4 data-line=\"13\" class=\"code-line\" dir=\"auto\" id=\"%E2%9C%85-%C3%A9tapes-couvertes\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅ Étapes couvertes :</h4><h3 data-line=\"0\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><ul data-line=\"14\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; font-size: 16px; font-weight: 400;\"><li data-line=\"14\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\"><span style=\"font-weight: 600;\">Empathie</span>&nbsp;: observation des utilisateurs cibles et de leurs besoins</li><li data-line=\"15\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Définition</span>&nbsp;: formulation claire de la problématique à résoudre</li><li data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Idéation</span>&nbsp;: génération d’idées et choix de la solution la plus pertinente</li><li data-line=\"17\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Prototype</span>&nbsp;: réalisation de maquettes pour tester l’interface ou l’expérience</li><li data-line=\"18\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Test</span>&nbsp;: premières validations auprès d’utilisateurs ou du formateur</li></ul><hr data-line=\"20\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; font-size: 16px; font-weight: 400;\"></h3><h3 data-line=\"22\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%94%B7-32-m%C3%A9thode-agile-scrum--une-gestion-de-projet-par-it%C3%A9rations\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🔷&nbsp;3.2. Méthode Agile (Scrum) : une gestion de projet par itérations</h3><h4 data-line=\"24\" class=\"code-line\" dir=\"auto\" id=\"%E2%9C%85-contenu-minimal-attendu\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅ Contenu minimal attendu</h4><h3 data-line=\"0\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><ol data-line=\"26\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; font-size: 16px; font-weight: 400;\"><li data-line=\"26\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\"><p data-line=\"26\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Présentation de la méthode Agile</span></p><blockquote data-line=\"27\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"27\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">La méthode Agile permet de piloter un projet de façon itérative et collaborative, en favorisant l’adaptation, la communication et la livraison fréquente de fonctionnalités.</p></blockquote></li><li data-line=\"29\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"29\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Choix de la méthodologie Scrum</span></p><blockquote data-line=\"30\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"30\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Scrum a été choisie pour son découpage en&nbsp;<span style=\"font-weight: 600;\">sprints</span>, ses&nbsp;<span style=\"font-weight: 600;\">rôles bien définis</span>&nbsp;(Scrum Master, Product Owner, Équipe), et sa structure basée sur l’amélioration continue (daily meetings, sprint review...).</p></blockquote></li><li data-line=\"32\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"32\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Organisation de l’équipe</span></p><blockquote data-line=\"33\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"33\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Répartition des rôles :</p></blockquote><ul data-line=\"34\" class=\"code-line\" dir=\"auto\" style=\"padding-left: 2em; position: relative;\"><li data-line=\"34\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\"><span style=\"font-weight: 600;\">Scrum Master</span>&nbsp;: [Nom] – facilitateur et garant de la méthode</li><li data-line=\"35\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Product Owner</span>&nbsp;: [Nom] – porteur de la vision du produit</li><li data-line=\"36\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Équipe de développement</span>&nbsp;: [Noms] – réalisation technique</li></ul></li><li data-line=\"38\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"38\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Découpage en sprints</span></p><blockquote data-line=\"39\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"39\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Le projet a été découpé en deux sprints :</p></blockquote><ul data-line=\"40\" class=\"code-line\" dir=\"auto\" style=\"padding-left: 2em; position: relative;\"><li data-line=\"40\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\"><span style=\"font-weight: 600;\">Sprint 1</span>&nbsp;: conception, maquettes, base fonctionnelle</li><li data-line=\"41\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Sprint 2</span>&nbsp;: développement des fonctionnalités complètes, finalisation et corrections</li></ul></li></ol><hr data-line=\"43\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; font-size: 16px; font-weight: 400;\"></h3><h3 data-line=\"45\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%9D-feedbacks-possibles\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📝&nbsp;Feedbacks possibles</h3><h3 data-line=\"0\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><ul data-line=\"47\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; font-size: 16px; font-weight: 400;\"><li data-line=\"47\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Méthode non expliquée ou absente</li><li data-line=\"48\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Description trop théorique, sans lien avec le projet réel</li><li data-line=\"49\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucun lien entre les phases de Design Thinking et les fonctionnalités développées</li><li data-line=\"50\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Choix de Scrum non justifié ou non respecté</li><li data-line=\"51\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Rôles dans l’équipe non mentionnés ou mal définis</li><li data-line=\"52\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Absence ou confusion dans le découpage en sprints</li><li data-line=\"53\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Copié-collé sans personnalisation, sans exemples concrets</li></ul></h3>',NULL,'2025-05-15 11:00:00','d3ad8b09-e6aa-4521-b40a-af507fa9c1ce',6,21,5,5,'2025-04-14 14:00:22','2025-05-22 09:13:24'),(97,'Diagramme de cas d\'utilisation - sprint 2','<h1 data-line=\"0\" class=\"code-line code-active-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-diagramme-de-cas-dutilisation-%E2%80%93-sprint-2\" style=\"margin: 24px 0px 16px; font-weight: 600; line-height: 1.25; font-size: 2em; padding-bottom: 0.3em; border-bottom: 1px solid rgb(234, 236, 239); border-top-color: rgba(0, 0, 0, 0.18); border-right-color: rgba(0, 0, 0, 0.18); border-left-color: rgba(0, 0, 0, 0.18); position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🗂️ Diagramme de cas d\'utilisation – Sprint 2</h1><h2 data-line=\"2\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%84-r%C3%A9sum%C3%A9-de-la-t%C3%A2che\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.5em; padding-bottom: 0.3em; border-bottom: 1px solid rgb(234, 236, 239); border-top-color: rgba(0, 0, 0, 0.18); border-right-color: rgba(0, 0, 0, 0.18); border-left-color: rgba(0, 0, 0, 0.18); position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📄 Résumé de la tâche</h2><p data-line=\"4\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Ce diagramme représente les&nbsp;<span style=\"font-weight: 600;\">fonctionnalités supplémentaires</span>&nbsp;ajoutées ou améliorées durant le&nbsp;<span style=\"font-weight: 600;\">Sprint 2</span>. Il complète le diagramme du Sprint 1 en mettant en avant les interactions supplémentaires entre les utilisateurs et le système, en fonction de l\'évolution du projet.</p><hr data-line=\"6\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h2 data-line=\"8\" class=\"code-line\" dir=\"auto\" id=\"%E2%9C%85-contenu-minimal-attendu\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.5em; padding-bottom: 0.3em; border-bottom: 1px solid rgb(234, 236, 239); border-top-color: rgba(0, 0, 0, 0.18); border-right-color: rgba(0, 0, 0, 0.18); border-left-color: rgba(0, 0, 0, 0.18); position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅ Contenu minimal attendu</h2><ol data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\"><p data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Acteurs concernés</span></p><blockquote data-line=\"11\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"11\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Les mêmes que dans le Sprint 1 (ex. Apprenant, Formateur), avec éventuellement des rôles supplémentaires si introduits.</p></blockquote></li><li data-line=\"13\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"13\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Nouveaux cas d’utilisation</span></p><blockquote data-line=\"14\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"14\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Représenter uniquement les&nbsp;<span style=\"font-weight: 600;\">fonctionnalités développées pendant le Sprint 2</span>.<br>Exemples :</p></blockquote><ul data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"padding-left: 2em; position: relative;\"><li data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Valider un projet</li><li data-line=\"17\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Ajouter un livrable</li><li data-line=\"18\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Consulter les statistiques</li><li data-line=\"19\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Envoyer un message</li></ul></li><li data-line=\"21\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"21\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Diagramme UML clair et lisible</span></p><blockquote data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Réalisé avec un outil adapté (draw.io, Lucidchart…) et inséré dans le rapport avec une légende.</p></blockquote></li><li data-line=\"24\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><p data-line=\"24\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 16px; margin-bottom: 16px; position: relative;\"><span style=\"font-weight: 600;\">Légende ou brève interprétation textuelle</span></p><blockquote data-line=\"25\" class=\"code-line\" dir=\"auto\" style=\"background-color: initial; border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative;\"><p data-line=\"25\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Description courte des cas d’utilisation pour montrer leur lien avec les fonctionnalités livrées.</p></blockquote></li></ol><hr data-line=\"27\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h2 data-line=\"30\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%9D-feedbacks-possibles\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.5em; padding-bottom: 0.3em; border-bottom: 1px solid rgb(234, 236, 239); border-top-color: rgba(0, 0, 0, 0.18); border-right-color: rgba(0, 0, 0, 0.18); border-left-color: rgba(0, 0, 0, 0.18); position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📝 Feedbacks possibles</h2><ul data-line=\"32\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"32\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Diagramme manquant ou non inséré dans le rapport</li><li data-line=\"33\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Cas d’utilisation non liés au Sprint 2</li><li data-line=\"34\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucune différence avec le diagramme du Sprint 1</li><li data-line=\"35\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Image floue, non lisible ou sans légende</li><li data-line=\"36\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Absence de description ou d’interprétation du diagramme</li><li data-line=\"37\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Cas d’utilisation trop vagues ou mal formulés</li><li data-line=\"38\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Utilisation incorrecte de la notation UML</li><li data-line=\"39\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Acteurs ou cas en doublon avec ceux déjà représentés sans justification</li></ul><hr data-line=\"41\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h2 data-line=\"43\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%92%A1-astuce\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.5em; padding-bottom: 0.3em; border-bottom: 1px solid rgb(234, 236, 239); border-top-color: rgba(0, 0, 0, 0.18); border-right-color: rgba(0, 0, 0, 0.18); border-left-color: rgba(0, 0, 0, 0.18); position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">💡 Astuce</h2><blockquote data-line=\"45\" class=\"code-line\" dir=\"auto\" style=\"border-left-width: 0.25em; border-left-color: rgb(223, 226, 229); margin: 0px 0px 16px; padding: 0px 1em; border-radius: 2px; color: rgb(106, 115, 125); position: relative; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><p data-line=\"45\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Ne répète pas tous les cas du Sprint 1. Le diagramme du Sprint 2 doit montrer ce qui&nbsp;<span style=\"font-weight: 600;\">a évolué</span>&nbsp;ou&nbsp;<span style=\"font-weight: 600;\">a été ajouté</span>, pour&nbsp;<span style=\"font-weight: 600;\">illustrer l\'avancement progressif du projet</span>.</p></blockquote>',NULL,'2025-05-19 13:00:00','e87ca1da-ef49-4242-90c3-632a148308b6',8,21,3,10,'2025-04-14 14:01:30','2025-05-22 09:13:24'),(98,'Réalisation – Sprint 1','<h3 data-line=\"0\" class=\"code-line code-active-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-r%C3%A9alisation-%E2%80%93-sprint-1\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🗂️&nbsp;Réalisation – Sprint 1</h3><h4 data-line=\"2\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%84-description-de-la-t%C3%A2che\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📄&nbsp;Description de la tâche</h4><p data-line=\"4\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Le&nbsp;<span style=\"font-weight: 600;\">Sprint 1</span>&nbsp;correspond à la&nbsp;<span style=\"font-weight: 600;\">première itération de développement</span>&nbsp;du projet. Il vise à transformer une partie des besoins fonctionnels en&nbsp;<span style=\"font-weight: 600;\">fonctionnalités concrètes</span>, en se basant sur le backlog défini en amont.</p><p data-line=\"6\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Ce sprint se concentre généralement sur :</p><ul data-line=\"7\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"7\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">La mise en place de l’environnement technique,</li><li data-line=\"8\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">La réalisation des&nbsp;<span style=\"font-weight: 600;\">fonctionnalités de base</span>&nbsp;(authentification, création d’un projet, navigation simple),</li><li data-line=\"9\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">L’intégration des premières interfaces,</li><li data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Le test initial de l’architecture du système.</li></ul><p data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">L’objectif est de livrer un&nbsp;<span style=\"font-weight: 600;\">MVP partiel</span>&nbsp;(version minimale utilisable), démontrant les premiers éléments fonctionnels.</p><hr data-line=\"14\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h3 data-line=\"16\" class=\"code-line\" dir=\"auto\" id=\"%E2%9C%85-contenu-minimal-attendu\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅&nbsp;Contenu minimal attendu</h3><ul data-line=\"18\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"18\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Liste des&nbsp;<span style=\"font-weight: 600;\">fonctionnalités développées</span>&nbsp;durant le Sprint 1</li><li data-line=\"19\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Captures d’écran</span>&nbsp;montrant les vues ou modules réalisés</li><li data-line=\"20\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Lien clair avec les cas d’utilisation</span>&nbsp;visés par ce sprint</li><li data-line=\"21\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Comparaison avec le plan initial</span>&nbsp;(avancement vs prévision)</li><li data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Identification des&nbsp;<span style=\"font-weight: 600;\">blocages techniques</span>&nbsp;ou problèmes rencontrés</li><li data-line=\"23\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">(Facultatif) Lien vers le code source ou dépôt GitHub</li></ul><hr data-line=\"25\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h3 data-line=\"27\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%9D-feedbacks-possibles\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📝&nbsp;Feedbacks possibles</h3><ul data-line=\"29\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"29\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Aucune liste des fonctionnalités développées</li><li data-line=\"30\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Le contenu présenté ne correspond pas aux cas d’utilisation du Sprint 1</li><li data-line=\"31\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Fonctionnalités incomplètes ou non testées</li><li data-line=\"32\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Captures d’écran absentes ou non commentées</li><li data-line=\"33\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucun lien avec le diagramme de cas d’utilisation</li><li data-line=\"34\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucune explication sur les choix techniques ou les difficultés rencontrées</li><li data-line=\"35\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Pas de preuve du travail réellement réalisé (ni capture, ni démonstration)</li><li data-line=\"36\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucune trace de collaboration ou de répartition du travail au sein de l’équipe</li><li data-line=\"37\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Résultat trop éloigné des objectifs fixés sans justification</li></ul>',NULL,'2025-05-23 12:00:00','b90e8664-24de-4328-9a73-cd70355db460',13,21,6,13,'2025-04-14 14:07:12','2025-06-02 07:50:37'),(99,'Réalisation – Sprint 2','<h3 data-line=\"0\" class=\"code-line code-active-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-r%C3%A9alisation-%E2%80%93-sprint-2\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🗂️&nbsp;Réalisation – Sprint 2</h3><h4 data-line=\"2\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%84-description-de-la-t%C3%A2che\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📄&nbsp;Description de la tâche</h4><p data-line=\"4\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Le&nbsp;<span style=\"font-weight: 600;\">Sprint 2</span>&nbsp;correspond à la&nbsp;<span style=\"font-weight: 600;\">deuxième itération de développement</span>&nbsp;du projet. Il a pour objectif de&nbsp;<span style=\"font-weight: 600;\">compléter</span>,&nbsp;<span style=\"font-weight: 600;\">améliorer</span>&nbsp;ou&nbsp;<span style=\"font-weight: 600;\">corriger</span>&nbsp;les fonctionnalités initiales développées au Sprint 1, tout en intégrant de&nbsp;<span style=\"font-weight: 600;\">nouvelles fonctionnalités avancées</span>&nbsp;prévues dans le backlog.</p><p data-line=\"6\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Ce sprint permet également de :</p><ul data-line=\"7\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"7\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Finaliser l’interface utilisateur,</li><li data-line=\"8\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Gérer les détails techniques plus complexes (filtrage, validation, navigation avancée…),</li><li data-line=\"9\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Corriger les bugs détectés lors du Sprint 1,</li><li data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Préparer la version livrable pour la soutenance ou la démonstration finale.</li></ul><hr data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h3 data-line=\"14\" class=\"code-line\" dir=\"auto\" id=\"%E2%9C%85-contenu-minimal-attendu\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅&nbsp;Contenu minimal attendu</h3><ul data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Liste des&nbsp;<span style=\"font-weight: 600;\">fonctionnalités ajoutées ou améliorées</span>&nbsp;dans le Sprint 2</li><li data-line=\"17\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Captures d’écran</span>&nbsp;illustrant les nouvelles interfaces ou modules</li><li data-line=\"18\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Liens clairs avec les cas d’utilisation non traités au Sprint 1</span></li><li data-line=\"19\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Explication des&nbsp;<span style=\"font-weight: 600;\">ajustements ou corrections</span>&nbsp;apportés</li><li data-line=\"20\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Problèmes techniques rencontrés</span>&nbsp;et comment ils ont été résolus</li><li data-line=\"21\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">(Facultatif) Mention de la collaboration ou des tests effectués entre les membres</li><li data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">État final du projet</span>&nbsp;(ce qui est complet, partiel ou abandonné)</li></ul><hr data-line=\"24\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h3 data-line=\"26\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%9D-feedbacks-possibles\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📝&nbsp;Feedbacks possibles</h3><ul data-line=\"28\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"28\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Aucune nouveauté claire par rapport au Sprint 1</li><li data-line=\"29\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Absence de captures ou preuves du travail réalisé</li><li data-line=\"30\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Fonctionnalités prévues non réalisées sans explication</li><li data-line=\"31\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucun lien entre ce qui est présenté et les cas d’utilisation définis</li><li data-line=\"32\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Problèmes non identifiés ou ignorés (pas de retour critique)</li><li data-line=\"33\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Partie trop courte ou peu approfondie</li><li data-line=\"34\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Absence de synthèse sur l’avancement global du projet</li><li data-line=\"35\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucun élément préparatoire à la soutenance ou à la livraison finale</li></ul>',NULL,'2025-05-30 12:00:00','849f7f99-7159-4ed0-9c34-4a5ba5943886',15,21,6,14,'2025-04-14 14:07:29','2025-06-02 07:50:53'),(100,'Conclusion','<h3 data-line=\"0\" class=\"code-line code-active-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-conclusion\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🗂️&nbsp;Conclusion</h3><h4 data-line=\"2\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%84-description-de-la-t%C3%A2che\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📄&nbsp;Description de la tâche</h4><p data-line=\"4\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">La conclusion est la&nbsp;<span style=\"font-weight: 600;\">dernière section du rapport</span>. Elle a pour but de faire un&nbsp;<span style=\"font-weight: 600;\">bilan global du projet</span>, de revenir sur les&nbsp;<span style=\"font-weight: 600;\">objectifs atteints</span>, d’identifier les&nbsp;<span style=\"font-weight: 600;\">points d’amélioration</span>, et éventuellement d’ouvrir sur des&nbsp;<span style=\"font-weight: 600;\">perspectives d’évolution</span>.</p><p data-line=\"6\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">Elle ne doit&nbsp;<span style=\"font-weight: 600;\">pas répéter</span>&nbsp;les détails techniques ou les descriptions déjà abordées, mais doit apporter une&nbsp;<span style=\"font-weight: 600;\">vue d’ensemble synthétique et critique</span>&nbsp;du travail réalisé.</p><hr data-line=\"8\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h3 data-line=\"10\" class=\"code-line\" dir=\"auto\" id=\"%E2%9C%85-contenu-minimal-attendu\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅&nbsp;Contenu minimal attendu</h3><ul data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\"><span style=\"font-weight: 600;\">Récapitulatif des objectifs atteints</span>&nbsp;(fonctionnalités développées, livrables produits)</li><li data-line=\"13\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Bilan personnel et technique</span>&nbsp;(ce qui a bien fonctionné, ce qui a été difficile)</li><li data-line=\"14\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Axes d\'amélioration</span>&nbsp;possibles (techniques, organisationnels, méthodologiques)</li><li data-line=\"15\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\"><span style=\"font-weight: 600;\">Perspectives futures</span>&nbsp;(fonctionnalités à ajouter, évolutions envisageables)</li><li data-line=\"16\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">(Facultatif) Remerciements ou retour sur l\'expérience en équipe</li></ul><hr data-line=\"18\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><h3 data-line=\"20\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%9D-feedbacks-possibles\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📝&nbsp;Feedbacks possibles</h3><ul data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><li data-line=\"22\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">❌ Conclusion absente ou vide</li><li data-line=\"23\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Trop courte, manque de contenu ou de recul</li><li data-line=\"24\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucune synthèse des points clés du projet</li><li data-line=\"25\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Absence d’analyse critique (juste une liste ou un copier-coller du sommaire)</li><li data-line=\"26\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Aucun retour sur le travail de groupe ou l’organisation du projet</li><li data-line=\"27\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Pas de propositions d’amélioration ni de pistes d’évolution</li><li data-line=\"28\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">❌ Ton inadapté (trop personnel ou trop vague)</li></ul>',NULL,'2025-06-06 12:00:00','33dbf139-3964-4908-8416-681a4983ea42',18,21,3,14,'2025-04-14 14:08:00','2025-06-02 07:50:14'),(101,'Page d\'inscription',NULL,NULL,NULL,'9e32c444-9b15-4d86-86b5-a0bf39a07e86',106,44,NULL,15,'2025-04-15 07:26:51','2025-04-28 14:49:56'),(102,'Organisation d\'un atelier',NULL,NULL,NULL,'747a8e5a-54e6-4930-9584-ce838cc0678e',107,46,NULL,2,'2025-04-15 07:28:36','2025-04-28 14:49:56'),(103,'Détermination des sujets à faire dans la veille','<p>Identifier et sélectionner des sujets technologiques pertinents pour effectuer une veille structurée et utile, en lien avec les intérêts de l’équipe et les tendances du domaine numérique.<br></p><p data-start=\"458\" data-end=\"614\" class=\"\">L’équipe doit organiser une séance de brainstorming et de recherche pour choisir les sujets à traiter dans le cadre de la veille. Chaque sujet retenu doit :</p><p>\r\n</p><ul data-start=\"616\" data-end=\"1000\">\r\n<li data-start=\"616\" data-end=\"745\" class=\"\">\r\n<p data-start=\"618\" data-end=\"745\" class=\"\">Être en lien avec le développement web, le réseau, le matériel ou l’innovation numérique (IA, cybersécurité, frameworks, etc.).</p>\r\n</li>\r\n<li data-start=\"746\" data-end=\"831\" class=\"\">\r\n<p data-start=\"748\" data-end=\"831\" class=\"\">Avoir un <strong data-start=\"757\" data-end=\"782\">potentiel pédagogique</strong> : nouveauté, utilité, pertinence dans le marché.</p>\r\n</li>\r\n<li data-start=\"832\" data-end=\"925\" class=\"\">\r\n<p data-start=\"834\" data-end=\"925\" class=\"\">Être <strong data-start=\"839\" data-end=\"855\">documentable</strong> : existence de sources fiables (articles, docs officielles, vidéos…).</p>\r\n</li>\r\n<li data-start=\"926\" data-end=\"1000\" class=\"\">\r\n<p data-start=\"928\" data-end=\"1000\" class=\"\">Pouvoir faire l’objet d’une <strong data-start=\"956\" data-end=\"983\">présentation vulgarisée</strong> (slide + flyer).</p></li></ul>',NULL,NULL,'0831e967-a244-4c61-88f0-5da8cd4d65ee',108,46,NULL,3,'2025-04-15 07:37:55','2025-04-28 14:49:56'),(104,'Page d\'authentification',NULL,NULL,NULL,'b5547ad2-9708-4d03-a1dd-f6b0d0fe93aa',109,44,NULL,16,'2025-04-15 07:39:20','2025-04-28 14:49:56'),(105,'Présentation de la veille','<p>Partager, vulgariser et valoriser les résultats de la veille technologique menée par l’équipe, à travers une présentation structurée et dynamique devant un public (classe, formateurs ou jury).<br></p><p data-start=\"480\" data-end=\"614\" class=\"\">Chaque équipe doit organiser une <strong data-start=\"513\" data-end=\"547\">présentation orale synthétique</strong> pour exposer les résultats de sa veille. Cette présentation doit :</p><p>\r\n</p><ul data-start=\"616\" data-end=\"1000\">\r\n<li data-start=\"616\" data-end=\"715\" class=\"\">\r\n<p data-start=\"618\" data-end=\"715\" class=\"\">Mettre en avant les <strong data-start=\"638\" data-end=\"656\">sujets étudiés</strong>, les raisons de leur choix, et les <strong data-start=\"692\" data-end=\"714\">enseignements clés</strong>.</p>\r\n</li>\r\n<li data-start=\"716\" data-end=\"798\" class=\"\">\r\n<p data-start=\"718\" data-end=\"798\" class=\"\">Utiliser un <strong data-start=\"730\" data-end=\"762\">diaporama clair et attractif</strong> (Google Slides, PowerPoint ou PDF).</p>\r\n</li>\r\n<li data-start=\"799\" data-end=\"919\" class=\"\">\r\n<p data-start=\"801\" data-end=\"919\" class=\"\">Appuyer la présentation avec des <strong data-start=\"834\" data-end=\"853\">visuels (flyer)</strong> et un lien vers le <strong data-start=\"873\" data-end=\"883\">GitHub</strong> contenant les ressources associées.</p>\r\n</li>\r\n<li data-start=\"920\" data-end=\"1000\" class=\"\">\r\n<p data-start=\"922\" data-end=\"1000\" class=\"\">Permettre une <strong data-start=\"936\" data-end=\"951\">interaction</strong> avec le public : quiz, démo, questions/réponses.</p><ul><li><strong data-start=\"1014\" data-end=\"1064\" style=\"color: inherit; font-family: inherit; font-size: 1.75rem;\">Contenu minimal attendu dans la présentation :</strong></li></ul><p data-start=\"922\" data-end=\"1000\" class=\"\">\r\n</p><ul data-start=\"1066\" data-end=\"1285\">\r\n<li data-start=\"1066\" data-end=\"1097\" class=\"\">\r\n<p data-start=\"1068\" data-end=\"1097\" class=\"\">Contexte général de la veille</p>\r\n</li>\r\n<li data-start=\"1098\" data-end=\"1151\" class=\"\">\r\n<p data-start=\"1100\" data-end=\"1151\" class=\"\">Présentation des sujets étudiés (1 slide par sujet)</p>\r\n</li>\r\n<li data-start=\"1152\" data-end=\"1175\" class=\"\">\r\n<p data-start=\"1154\" data-end=\"1175\" class=\"\">Pourquoi ces sujets ?</p>\r\n</li>\r\n<li data-start=\"1176\" data-end=\"1205\" class=\"\">\r\n<p data-start=\"1178\" data-end=\"1205\" class=\"\">Résumé de ce qu’on a appris</p>\r\n</li>\r\n<li data-start=\"1206\" data-end=\"1242\" class=\"\">\r\n<p data-start=\"1208\" data-end=\"1242\" class=\"\">Ressources (liens, outils, vidéos)</p>\r\n</li>\r\n<li data-start=\"1243\" data-end=\"1285\" class=\"\">\r\n<p data-start=\"1245\" data-end=\"1285\" class=\"\">Démonstration ou cas d’usage si possible</p></li></ul></li></ul>',NULL,NULL,'00ca4e41-dbd6-4c7e-adcc-4034c12eaf08',110,46,NULL,4,'2025-04-15 07:43:53','2025-04-28 14:49:56'),(106,'Gestion des transactions (CRUD)',NULL,NULL,NULL,'1114ca39-895a-4a48-a46f-2d89e752071f',111,44,NULL,17,'2025-04-15 07:49:09','2025-04-28 14:49:56'),(107,'Dashboard Utilisateur',NULL,NULL,NULL,'e5780dea-e2ba-4257-b6f1-055fda648ccc',112,44,NULL,28,'2025-04-15 07:50:37','2025-04-28 14:49:56'),(108,'Live coding OnePage',NULL,NULL,NULL,'ea5b4fff-3404-4a0e-ac58-325b7093eb7a',113,23,