5-28 12:45:07'),(144,'Rapport',NULL,'2025-04-01 12:00:00','2025-06-10 12:00:00','3957464f-dae4-42df-bf24-d319c42ded71',9,34,3,23,'2025-04-28 12:18:33','2025-05-28 12:45:30'),(145,'Powerpoint',NULL,'2025-04-01 12:00:00','2025-06-10 12:00:00','3dc6f0f8-fd99-4526-a8f8-42a14b334b1e',10,34,3,23,'2025-04-28 12:19:23','2025-05-28 12:46:37'),(147,'Intégration d\'un formulaire de contact dans un site web WP','<p>Intégration d\'un formulaire de contact dans un site web WP</p>',NULL,NULL,'fd864460-03ff-48d9-aed4-fc0ce71574ee',116,50,NULL,NULL,'2025-05-12 07:27:00','2025-05-12 07:27:00'),(148,'Installation et configuration de WordPress en local',NULL,NULL,NULL,'3ef656ea-3bc3-4cc5-a464-4fbe7642cfec',1,51,NULL,7,'2025-05-12 07:45:25','2025-05-12 07:45:25'),(149,'Autoformation WordPress',NULL,NULL,NULL,'7c0ad9d7-405d-497a-8831-16284bf21679',2,51,NULL,8,'2025-05-12 07:45:50','2025-05-15 11:29:29'),(150,'Réaliser le site vitrine',NULL,NULL,NULL,'95075b6d-874a-4822-be7d-c47cd54b0477',3,51,0,9,'2025-05-12 07:46:22','2025-05-21 09:54:49'),(151,'Table des matières','<h3 data-line=\"0\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-table-des-mati%C3%A8res\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">🗂️&nbsp;Table des matières</h3><h4 data-line=\"2\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%84-description-de-la-t%C3%A2che\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📄&nbsp;Description de la tâche</h4><h3 data-line=\"0\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-table-des-mati%C3%A8res\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><p data-line=\"3\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; position: relative; font-size: 16px; font-weight: 400;\">La table des matières permet de&nbsp;<span style=\"font-weight: 600;\">naviguer facilement</span>&nbsp;dans le rapport. Elle liste tous les&nbsp;<span style=\"font-weight: 600;\">chapitres et sous-chapitres</span>&nbsp;avec leur&nbsp;<span style=\"font-weight: 600;\">numérotation et numéro de page</span>. Elle doit refléter fidèlement la structure du document et être&nbsp;<span style=\"font-weight: 600;\">mise à jour automatiquement</span>&nbsp;si possible (ex. via Word ou Google Docs).</p><hr data-line=\"5\" class=\"code-line\" dir=\"auto\" style=\"border-top: 0px; height: 0.25em; box-sizing: initial; overflow: hidden; margin: 24px 0px; background: rgb(225, 228, 232); padding: 0px; position: relative; font-size: 16px; font-weight: 400;\"></h3><h4 data-line=\"7\" class=\"code-line\" dir=\"auto\" id=\"%E2%9C%85-contenu-minimal-attendu\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 16px; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">✅&nbsp;Contenu minimal attendu</h4><h3 data-line=\"0\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\"><ul data-line=\"9\" class=\"code-line\" dir=\"auto\" style=\"margin-bottom: 16px; padding-left: 2em; position: relative; font-size: 16px; font-weight: 400;\"><li data-line=\"9\" class=\"code-line\" dir=\"auto\" style=\"position: relative;\">Titres de tous les chapitres et sous-sections</li><li data-line=\"10\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Numérotation cohérente (ex. 1, 1.1, 1.2, 2…)</li><li data-line=\"11\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Numéros de pages corrects</li><li data-line=\"12\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Correspondance exacte avec les titres réels du rapport</li><li data-line=\"13\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Alignement propre et lisibilité assurée</li><li data-line=\"14\" class=\"code-line\" dir=\"auto\" style=\"margin-top: 0.25em; position: relative;\">Générée automatiquement si possible (éviter les copier-coller manuels)</li></ul></h3><h3 data-line=\"17\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%93%98-plan-de-rapport-minimal-%E2%80%93-projet-file-rouge\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;\">📘&nbsp;Plan de rapport minimal – Projet File Rouge</h3><h3 data-line=\"20\" class=\"code-line\" dir=\"auto\" id=\"%F0%9F%97%82%EF%B8%8F-1-page-de-garde\" style=\"margin-top: 24px; font-weight: 600; margin-bottom: 16px; line-height: 1.25; font-size: 1.25em; position: relative; color: rgb(36, 41, 46); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quo